(47, '210101-210107', 'JIM LAN Tech Refresh', 'PEROLEHAN INFRASTRUKTUR RANGKAIAN KESELAMATAN ICT PUSAT DATA DAN IBU PEJABAT JABATAN IMIGRESEN MALAYSIA (JIM) [NO. TENDER: KDN/PL 8/2022-PTM]', 0, 0, 24, 0, 0, 0, 6, NULL, 6, '2022-04-05', NULL, 11866866.00, 10786044.00, NULL, NULL, NULL, 12, 36, 11866866, '2022-10-03', '<p>Tech refresh of current active equipments and firewall</p>', '<p>1 year implementation + 3 years warranty</p>', '<p>Working with Huawei and Fortinet solution.</p>', NULL, NULL, NULL, '20 bidders. Price ranked 15/20. Ranges from 7.4M to 17.5M. Budget info at 8.6M\nLost to IBuruj at RM 8,350,614.85\n', '2022-04-04 16:00:00', 0, 0, NULL, 0),
(48, '210101', 'PLUS Network Refresh Nationwide', 'NEW NETWORK EQUIPMENT (LAN SWITCHES) TO REPLACE END OF LIFE (EOL) DEVICES\n- REQUEST FOR QUOTATION (“RFQ”)', 0, 0, 25, 0, 0, 0, 6, NULL, 6, '2022-04-05', NULL, 16625215.00, 15052954.00, NULL, NULL, NULL, 6, 60, 16381486, '2022-04-05', '<p>Tech refresh of Cisco networks, firewall and Internet Access Gateway</p>', '<p>6 months deployment</p>', '<p>Working with Extreme solution, Fortinet and Sangfor</p><p>8 bidders invited. CTC Global,&nbsp;Turbine Technique (M) Sdn Bhd, eInsight, TM, Time, BridgeNet</p>', NULL, NULL, NULL, '8 bidders. Network Refresh\nTechnical clarification on 13 April 2022\nTender cancel\nTechnical resubmission 20 April 2022\nDid not pass the technical evaluation. Because popsoe Sangfor IAM. PLUS dont favor Sangfor', '2022-04-04 16:00:00', 0, 0, NULL, 0),
(49, '210101', 'REQUEST FOR QUOTATION (RFQ) FOR TH WORKLOAD AUTOMATION MANAGEMENT', 'REQUEST FOR QUOTATION (RFQ) FOR TH WORKLOAD AUTOMATIONMANAGEMENT', 0, 0, 44, 0, 0, 0, 5, NULL, 7, '2022-03-23', NULL, 1897444.52, 1612827.84, NULL, NULL, NULL, 6, 60, 1897445, '2022-06-30', '<p><span></span></p><p>Implementation of new workload automation management. Propose BMC solution</p>', '<p>4 months implementation</p>', '<p>Working with IkonP. </p><p>Price cheapest. The rest above 2M</p>', NULL, NULL, '2022-06-16', 'Tender submission date 3 March 2022\nSST received 16 June 2022', '2022-03-22 16:00:00', 0, 0, NULL, 0),
(50, '210101', 'Enhancement on eHemodialisis Application', 'PROPOSAL TO DESIGN, DEVELOP, TEST, INSTALL AND COMISSION ENHANCEMENT ON EHEMODIALISIS SYSTEM FOR KWAP - RFQ No: KWAP/01/122/22/07', 0, 0, 40, 0, 0, 0, 6, NULL, 5, '2022-04-05', NULL, 298662.42, 274769.43, NULL, NULL, NULL, 4, 12, 281757, '2022-07-01', '<p>Enhancement of current eHEMODIALISIS SYSTEM</p>', '<p>4 months</p>', '<p>working with IkonP</p>', NULL, NULL, NULL, 'Sebutharga submitted 4 March 2022\nRetender', '2022-04-04 16:00:00', 0, 0, NULL, 0),
(51, '', 'PEROLEHAN PERKHIDMATAN SEWAAN PERALATAN RANGKAIAN (WEB APPLICATION FIREWALL (WAF) DAN MANAGED-WIFI) DI AGENSI PENGUATKUASAAN MARITIM MALAYSIA (APMM) BAGI TEMPOH 36 BULAN', '', 0, 0, 1, 0, 0, 0, 6, NULL, 1, '0000-00-00', NULL, 2625948.00, 2497876.00, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '', '', '', NULL, NULL, NULL, '16 bidders. Budget at 2.4M with varianceof +/- 10%\nPrice ranked 11/16\nTechnical shorlisted but financially not shorlisted\noverall did not shorlist', '0000-00-00 00:00:00', 0, 0, NULL, 0),
(53, '', 'ICT Branch Maintenance', '', 0, 0, 15, 0, 0, 0, 6, NULL, 6, '0000-00-00', NULL, 17822822.04, 15908849.00, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '', '', '', NULL, NULL, NULL, 'Maintenance of ICT equipments in JPJ branches. Current contract under Nisin Tech. Price ranked 3/9.\nRETENDER', '0000-00-00 00:00:00', 0, 0, NULL, 0),
(54, '', 'Branch KIOSK Phase 2', '', 0, 0, 15, 0, 0, 0, 6, NULL, 1, '0000-00-00', NULL, 14351176.76, 12348240.00, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '', '', '', NULL, NULL, NULL, 'Phase 2 - 100 units of KIosk\nOverall ranking top 3\nLost to Nite Electronic at RM 13,522,500.00\nTender board 23 June 2022\nLOST to Nite Electronic', '0000-00-00 00:00:00', 0, 0, NULL, 0),
(55, '210101 , 02, 03, 09, 120401, 120502,', 'PERKHIDMATAN SEWAAN KAMERA LITAR TERTUTUP (CCTV) DI PINTU KELUAR MASUK NEGARA (ZON SEMENANJUNG) JABATAN IMIGRESEN MALAYSIA', 'PERKHIDMATAN SEWAAN KAMERA LITAR TERTUTUP (CCTV) DI PINTU KELUAR MASUK NEGARA YANG DILULUSKAN MELALUI GOVERNANCE INTEGRITY ANTI\nCORRUPTION CENTER (GIACC) - ZON SEMENANJUNG', 0, 0, 24, 0, 0, 0, 6, NULL, 6, '2022-08-18', NULL, 30837884.40, 24969142.00, NULL, NULL, NULL, 5, 36, 30171240, '2023-01-02', '<p style=\"text-align:justify;line-height:150%;margin:0cm;margin-bottom:.0001pt;font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\"><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Perkhidmatan Sewaan Kamera\nLitar Tertutup (CCTV) Di Pintu Keluar Masuk Negara Yang Diluluskan Melalui\nGovernance Integrity Anti-Corruption Center (GIACC) telah dipersetujui melalui\nJawatankuasa Khas Kabinet Mengenai Anti-Rasuah (JKKMAR) 5/2019 pada 19\nSeptember 2019 bagi meningkatkan kecekapan Jabatan Imigresen Malaysia (JIM) dan\nintegriti pegawainya.</span></p><p style=\"text-align:justify;line-height:150%;margin:0cm;margin-bottom:.0001pt;font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\"><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Bagi meningkatkan tahap\nintegriti pegawai dan kawalan isu-isu melibatkan urusniaga pelawat di\nkaunter-kaunter imigresen, kamera yang dipasang di kaunter-kaunter imigresen\nhendaklah meliputi pandangan ruang kerja pegawai di kaunter termasuk komputer\ndan monitor, pandangan dari sisi atau belakang pegawai dan pandangan penuh\nwajah pelawat yang berurusan atau melauli kaunter tersebut. Manakala bagi\npemantauan keselamatan di persekitaran tempat kerja JIM, kamera yang ditawarkan\nhendaklah mempunyai spesifikasi video dalam suasana kurang cahaya yang baik.\nKamera litar tertutup yang ditawarkan juga hendaklah kamera yang dipasang perlu\nmempunyai keupayaan analitik seperti pergerakan keluar masuk atau merentasi\nkawasan yang tidak dibenarkan, amaran kerosakan sistem atau kamera, dan\npengecaman wajah bagi profil yang telah didaftar masuk ke dalam sistem litar\ntertutup kamera (CCTV) tersebut.</span></p>', '<p>5 months.&nbsp;</p>', '<p>IPS is working with Huawei for the full CCTV solution.&nbsp; Major competitor HIK Vision.&nbsp;</p><p>Hiawei/Laiyon assisting in the project lobby.</p>', NULL, NULL, NULL, 'Retender.\nPice Ranking 7/42.\nWill retender again\nPossibility of retender again\nLaiyon is 100K more expensive.\neP has posted RETENDER', '2022-08-17 16:00:00', 0, 0, NULL, 0),
(56, '210101 , 02, 03, 09, 120401, 120502', 'PERKHIDMATAN SEWAAN KAMERA LITAR TERTUTUP (CCTV) DI PINTU KELUAR MASUK NEGARA (ZON SABAH, SARAWAK, LABUAN) JABATAN IMIGRESEN MALAYSIA', 'PERKHIDMATAN SEWAAN KAMERA LITAR TERTUTUP (CCTV) DI PINTU KELUAR MASUK NEGARA YANG DILULUSKAN MELALUI GOVERNANCE INTEGRITY ANTI\nCORRUPTION CENTER (GIACC) - ZON SABAH,SARAWAK DAN LABUAN', 0, 0, 24, 0, 0, 0, 6, NULL, 1, '2022-08-18', NULL, 15747039.00, 13700089.00, NULL, NULL, NULL, 5, 36, 15747039, '2023-01-02', '<p>Perkhidmatan Sewaan Kamera Litar Tertutup (CCTV) Di Pintu Keluar Masuk Negara Yang Diluluskan Melalui Governance Integrity Anti-Corruption Center (GIACC) telah dipersetujui melalui Jawatankuasa Khas Kabinet Mengenai Anti-Rasuah (JKKMAR) 5/2019 pada 19 September 2019 bagi meningkatkan kecekapan Jabatan Imigresen Malaysia (JIM) dan integriti pegawainya.</p><p>Bagi meningkatkan tahap integriti pegawai dan kawalan isu-isu melibatkan urusniaga pelawat di kaunter-kaunter imigresen, kamera yang dipasang di kaunter-kaunter imigresen hendaklah meliputi pandangan ruang kerja pegawai di kaunter termasuk komputer dan monitor, pandangan dari sisi atau belakang pegawai dan pandangan penuh wajah pelawat yang berurusan atau melauli kaunter tersebut. Manakala bagi pemantauan keselamatan di persekitaran tempat kerja JIM, kamera yang ditawarkan hendaklah mempunyai spesifikasi video dalam suasana kurang cahaya yang baik. Kamera litar tertutup yang ditawarkan juga hendaklah kamera yang dipasang perlu mempunyai keupayaan analitik seperti pergerakan keluar masuk atau merentasi kawasan yang tidak dibenarkan, amaran kerosakan sistem atau kamera, dan pengecaman wajah bagi profil yang telah didaftar masuk ke dalam sistem litar tertutup kamera (CCTV) tersebut.</p>', '<p>5 months</p>', '<p>IPS is working with Huawei for the full CCTV solution. Major competitor HIK Vision.</p><p><span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">Hiawei/Laiyon assisting in the project lobby.</span><br></p>', NULL, NULL, NULL, 'Retender. Price ranking no 11/32.\nLaiyon is 100k cheaper\nWill retender again\nPossibility of retender again\neP Phas posted RETENDER', '2022-08-17 16:00:00', 0, 0, NULL, 0),
