(67, 'SSM 3/2022', 'SSM Middleware', 'SUPPLY, IMPLEMENTATION, TRAINING, SUPPORT, WARRANTY AND MAINTENANCE OF MIDDLEWARE INFRASTRUCTURE', 0, 0, 64, 0, 0, 0, 5, NULL, 7, '2022-03-09', NULL, 7110000.00, 6890000.00, NULL, NULL, NULL, 8, 32, 7484848, '2022-06-27', '<p style=\" margin: 0cm; font-size: 11pt; line-height: 16.8667px; text-align: justify; font-family: Arial, sans-serif;\"><br></p><p><span lang=\"EN-US\">The objective of the proposal is:</span></p><ul type=\"square\" style=\"margin-top:0cm;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">Enhance the middleware\ninfrastructure and requirements to meet SSM customers’ needs.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">Provide system and expertise in\ndeveloping web services and integration for data exchange purposes.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">Migrate existing web services users\nand activities for integrated Agencies to the new middleware infrastructure\nplatform.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">Prepare and design a resilient and\nhighly available middleware framework to provide maximum serviceability to all\nSSM customers – both internal users and external Agencies.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">To perform testing and quality assurance.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">To provide warranty, support, maintenance and manage services during\nthe duration of the contract.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">To provide documentation during the duration of the contract.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">To provide transfer of knowledge/ training\nfor the proposed solution</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">To provide project management\nservices for throughout the contract period</span></p></li>\n\n</ul><p><br></p><h1 style=\"margin-top:12.0pt;margin-right:0cm;margin-bottom:3.0pt;margin-left:21.6pt;line-height:150%;font-size:14.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><a name=\"_Toc97658935\"><span lang=\"DE\">Proposed Solution</span></a></h1><p style=\"text-align:justify;line-height:150%;margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><span lang=\"EN-US\">Our proposed solution mainly on IBM Middleware software\nsolution and RedHat OpenShift components. The proposed middleware solution provides a secured and unified user\nexperiences; shielding away the backend technologies and any platform or\napplication changes made, that is supposed to be transparent to the users. Part\nof ensuring maximum serviceability to the users, the proposed middleware\nsolution is supported both on cloud or on premise; or even if SSM opts for\nhybrid environment to reap the benefits of both world.</span></p>', '<h1 style=\" margin: 12pt 0cm 3pt 21.6pt; font-weight: 400; line-height: 28px; font-size: 14pt; color: rgb(51, 51, 51); font-style: normal; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif;\"><a name=\"_Toc97658940\" style=\" color: rgb(46, 46, 241); text-decoration: none; background-color: transparent;\"><span lang=\"EN-GB\">Implementation Timeline</span></a></h1><p style=\" margin: 0cm 0cm 8pt; font-size: 11pt; line-height: 22px; color: rgb(51, 51, 51); font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif;\"><span lang=\"EN-GB\">We expect to complete the implementation within 8 months as per tender requirement.</span></p><p><br></p><p style=\"text-align:justify;line-height:115%;margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><span lang=\"EN-GB\">The key software components proposed within the middleware solution\nare:</span></p><ul level=\"1\" style=\"list-style-type: disc;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">IBM Secure API Gateway</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">IBM API Management</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">IBM Enterprise Service Bus</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">IBM MQ messaging</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">IBM Kafka event streaming, and </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">IBM Aspera High Speed File\nTransfer</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN-GB\">RedHat OpenShift Container\nPlatform &amp; Operational Services</span></p></li></ul><p><br></p><p style=\"line-height:150%;margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><span lang=\"EN\">With the proposed new middleware, SSM will gain the\nfollowing benefits: </span></p><ul level=\"1\" style=\"list-style-type: square; margin-bottom: 0cm; list-style-image: none;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN\">Off-the-shelf API Management Platform based on OpenAPI\nstandard</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN\">Zero/minimum coding for the Integration layer to speed\nup new service creation</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN\">Automation &amp; Self Service for subscriber/developer\nonboarding &amp; API testing</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN\">Centralized secure gateway for both files &amp; API\nintegration</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\"><p><span lang=\"EN\">Container Platform with high agility and scalability</span></p></li></ul>', '<ol><li style=\"margin-bottom:0cm;text-align:justify;line-height:\n115%;margin-top:0cm;margin-right:0cm;margin-left:0cm;font-size:11.0pt;font-family:&quot;arial&quot;,sans-serif;\">We have position the right solution for SSM ie IBM</li><li style=\"margin-bottom:0cm;text-align:justify;line-height:\n115%;margin-top:0cm;margin-right:0cm;margin-left:0cm;font-size:11.0pt;font-family:&quot;arial&quot;,sans-serif;\">We have early engagement with IBM and special price given during tender submission<br></li><li style=\"margin-bottom:0cm;text-align:justify;line-height:\n115%;margin-top:0cm;margin-right:0cm;margin-left:0cm;font-size:11.0pt;font-family:&quot;arial&quot;,sans-serif;\">We will work with IkonP as our implementation partner which has experienced on Middleware</li><li style=\"margin-bottom:0cm;text-align:justify;line-height:\n115%;margin-top:0cm;margin-right:0cm;margin-left:0cm;font-size:11.0pt;font-family:&quot;arial&quot;,sans-serif;\">We can comply to SSM timeline 8 months for implementation</li></ol>', NULL, NULL, '2022-09-08', 'submission 9/3/2022.\nprice ranking 1/3\nAfter evaluation, overall ranking no 1\nTender board 22 June 2022\nSST date: 8 Sept 2022', '2022-05-22 16:00:00', 0, 0, NULL, 0),
