(98, '210101, 02, 03,05, 07, 09', 'Tender For Leasing of Nework Infrastructure For UIAM, Gombak', 'TENDER FOR LEASING OF NETWORK INFRASTRUCTURE UPGRADE,\nINTERNATIONAL ISLAMIC UNIVERSITY MALAYSIA,\nGOMBAK CAMPUS. 10 YEARS LEASE TO USE\n', 0, 0, 74, 0, 0, 0, 6, NULL, 10, '2022-08-22', NULL, 32939863.00, 28827506.00, NULL, NULL, NULL, 24, 120, 34916273, '2022-12-01', '<div style=\"margin-top:0pt;margin-bottom:0pt;margin-left:.31in;\ntext-indent:-.31in;text-align:left;direction:ltr;\"><span style=\"font-size:18.0pt;font-family:Calibri;\ncolor:white;\"><span style=\"font-size:18.0pt;font-family:Calibri;color:white;\">To replace and upgrade of<img src=\"blob:http://sfa.isianpadu.com/c267e333-dde5-4234-8b56-d91bed492a51\" class=\"e-rte-image e-imginline\" width=\"auto\" height=\"auto\" style=\"min-width: 0px; max-width: 905px; min-height: 0px;\"> WAN, Core, Distribution and Access switches</span>o\nrepe and upgrade of WAN, Core, Distribution and Access switches. </span></div>', '<p>2 years. 1 year CISCO delivery. 1 year implementation in Campus Gombak.</p>', '<p>Work closely with Strategic Alliance and CISCO. Price rankes 8/12. Price quoted with SST</p><p><img src=\"blob:http://sfa.isianpadu.com/f238a5c8-4c77-41b5-9a8c-13566fa07ee4\" class=\"e-rte-image e-imginline\" width=\"auto\" height=\"auto\" style=\"min-width: 0px; max-width: 907px; min-height: 0px;\"> <br></p>', NULL, NULL, NULL, 'CISCO network lease-to-own for 10 years\nPrice ranking 8/10. Ranges from 19M to 40M', '2022-08-21 16:00:00', 65653, 0, '0000-00-00 00:00:00', 0),
(99, 'DBP/02/2022', 'DBP Network Infra', 'PERKHIDMATAN NAIK TARAF RANGKAIAN KOMPUTER\n(PENGGANTIAN DAN PENAMBAHAN SUIS LANTAI)\nDEWAN BAHASA DAN PUSTAKA', 0, 0, 76, 0, 0, 0, 6, NULL, 6, '2022-04-28', NULL, 1727727.00, 1685238.00, NULL, NULL, NULL, 6, 36, 1727727, '2022-06-13', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-family:&quot;Arial&quot;,sans-serif;\">Melaksanakan pemasangan,\nkonfigurasi, pengujian dan pentauliahan pada semua perkakasan, peralatan\nrangkaian, dan perisian yang terlibat sepanjang 3 tahun kontrak berserta latihan, sokongan dan penyelenggaraan.</span></p><p>OBJEKTIF:</p><ol><li>﻿﻿Melaksanakan pemasangan,\nkonfigurasi, pengujian dan pentauliahan pada semua perkakasan, peralatan\nrangkaian, dan perisian yang terlibat sepanjang 3 tahun kontrak</li><li>Menyediakan\nsuis lantai yang menyokong sepenuhnya teknologi Software Define Network(SDN)\ntanpa memerlukan sebarang kos tambahan.</li><li>Sistem\npemantauan rangkaian yang disediakan boleh menguruskan suis lantai di semua\ncawangan dan memudahkan urusan penyelesaian masalah (troubleshooting) kelak\ndengan menyediakn notifikasi dan penggera sekiranya berlaku masalah.</li></ol><p>Senarai rangkaian yang terlibat:</p><ul><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;calibri&quot;,sans-serif;\"><span lang=\"EN-US\">73 unit\nsuis lantai bagi menggantikan 63 unit suis lantai semasa dan penambahan 10 unit\nsuis lantai baharu di lokasi yang telah ditetapkan</span></li></ul><p>Senarai pengkabelan UTP yang terlibat:</p><ul><li>Kabel UTP, Modular Jack, Faceplat, 48-port Patch Panel (loaded), Patch cord (3m)</li></ul><p>Senarai pengkabelan FIBER yang terlibat:</p><ul><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;calibri&quot;,sans-serif;\"><span lang=\"EN-US\">6-Core\nKabel Gentian, Fibre Patch Panel 24 port dengan SC coupler duplex, Fibre Patch\nPanel 12 port dengan SC coupler duplex, Pigtail SC, Fibre Patch Cord duplex\n(SC/LC) 3m</span></li></ul><p>Senarai perisian yang terlibat:</p><ul><li style=\"margin-right: 0cm; line-height: 115%; font-size: 11pt; font-family: Calibri, sans-serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Sistem\nPemantauan Rangkaian (NMS) beserta Lesen</span></p></li></ul><p>HARGA ISIANPADU:</p><p>Kos perkakasan: 1,376,067.00</p><p>Kos perisian: 64,862.00</p><p>Kos perkhidmatan: 286,798.00</p><p>Total: 1,727,727.00</p><p><br></p>', '<p>Isianpadu<span style=\"font-family:&quot;Arial&quot;,sans-serif;\"> mencadangkan sistem kabel yang mempunyai lebar jalur yang tinggi dan\npenyelesaian yang paling kos efektif untuk menyokong Dewan Bahasa dan Pustaka\n(DBP).</span></p>', '<p><span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">Isianpadu</span><span style=\" color: rgb(51, 51, 51); font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif;\"><span>&nbsp;</span>mencadangkan sistem kabel yang mempunyai lebar jalur yang tinggi dan penyelesaian yang paling kos efektif untuk menyokong Dewan Bahasa dan Pustaka (DBP).</span></p><p><span style=\" color: rgb(51, 51, 51); font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); font-family: Arial, sans-serif;\"></span>Working with ACA and UC.</p><p>Rank 9 out of 12 company participated.</p><p>We proposed H3C. Lost to Aruba.</p>', NULL, NULL, NULL, 'Ranking 9 out of 12. Cheapest is 1,268,800.00 we submit 1,727,727.00. Proposed H3C solution (ACA & UC)', '2022-06-12 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
