(117, '18 /2022', 'Mara IKM Network', 'CADANGAN MEMBEKAL, MENGHANTAR, MEMASANG, MENGUJI, MELATIH DAN MENTAULIAH\nPERKAKASAN, PERISIAN DAN RANGKAIAN ICT BAGI PENGGANTIAN SISTEM RANGKAIAN DI INSTITUT\nKEMAHIRAN MARA (IKM) TYSA, PEKAN PAHANG', 0, 0, 13, 0, 0, 0, 6, NULL, 6, '2022-06-13', NULL, 1333051.00, 1200447.00, NULL, NULL, NULL, 6, 36, 1333501, '2022-06-13', '<p><span lang=\"EN-CA\" style=\"font-size:11.0pt;font-family:\n&quot;Arial&quot;,sans-serif;\">SKOP TENDER:</span></p><p><span lang=\"EN-CA\" style=\"font-size:11.0pt;font-family:\n&quot;Arial&quot;,sans-serif;\">Kami akan melaksanakan membekal,\nmenghantar, memasang, menguji, melatih dan mentauliah perkakasan, perisian dan\nrangkaian ICT untuk semua perkakasan dan perisian yang telah disenaraikan sepanjang tempoh kontrak iaitu 3 tahun (36 bulan).</span></p><p><span lang=\"EN-CA\" style=\"font-size:11.0pt;font-family:\n&quot;Arial&quot;,sans-serif;\">Senarai peralatan yang terlibat seperti berikut:</span></p><ul level=\"1\" style=\"list-style-type: disc;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Wireless\nController</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Wireless\nController Lisence</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Indoor\nWiFi6 AP - Medium Desity</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Indoor\nWiFi6 AP - High Density (Dewan)</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Outdoor\nWiFi6 AP - Outdoor</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">POE+\nInjector</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Switch\nRack 9U</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Automatic\nVoltage Regulator (AVR) c/w UPS 1000VA </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Cabling\n- UTP Cat6 (Access Point + Network Nodes)</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Cabling\n- UTP Cat6 Outdoor </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Cabling\n- UTP Patch Cord 2 meter</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Cabling\n- UTP Patch Cord 3 meter</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">UTP\nCat6 Patch Panel 24Port</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Cable\nManagement Unit </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Multimode\n8 Outdoor OM3 </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Singlemode\n8 core Outdoor OS2</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Fiber\nPatch Cord SM OS2 - 3 meter </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Fiber\nPatch Cord MM OM3<span>&nbsp; </span>- 3 meter </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Fiber\nTermination Unit (FTU) 24 port</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Fiber\nTermination Unit (FTU) 8 port</span></p></li></ul><p>Senarai perisian yang terlibat seperti berikut:</p><ul level=\"1\" style=\"list-style-type: disc;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:10.0pt;margin-left:36.0pt;line-height:115%;font-size:12.0pt;font-family:&quot;Times&quot;,serif;\"><p><span lang=\"EN-US\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Network\nMonitoring System (NMS)/Lisence</span></p></li></ul><p>HARGA ISIANPADU:</p><p>Peralatan: 1,204,303.00</p><p>Perisian: 39,600.00</p><p>Perkhidmatan: 89,598.00</p><p>Total: 1,333,501.00</p>', '<ol><li style=\"text-align:justify;line-height:150%;margin:0cm;font-size:12.0pt;font-family:&quot;times&quot;,serif;\"><span lang=\"EN-CA\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Isianpadu mencadangkan tempoh\npelaksanaan adalah selama 6 bulan.&nbsp;</span><span lang=\"EN-CA\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Pembekalan,\npenghantaran, pemasangan dan pengujian akan dijalankan secara berfasa ke atas\nperalatan yang mampu diproduksikan dan dibekalkan oleh pihak prinsipal dahulu</span></li><li style=\"text-align:justify;line-height:150%;margin:0cm;font-size:12.0pt;font-family:&quot;times&quot;,serif;\"><span lang=\"EN-CA\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Isianpadu akan berkerjasama dengan ATS didalam tender ini dimana Isianpadu sebagai frontliner.</span></li></ol>', '<p>Sej