(130, '41/2022', 'MARA Data Management System (DMS)', 'CADANGAN PEROLEHAN MARA DEBT MANAGEMENT SYSTEMS (DMS)', 0, 0, 13, 0, 0, 0, 6, NULL, 7, '2022-06-21', NULL, 5422877.00, 4578303.00, NULL, NULL, NULL, 12, 12, 5422877, '2022-12-31', '<p>Isianpadu akan melaksanakan projek ini dengan menyediakan perkhidmatan pengurusan projek yang komprehensif, membangunkan sistem aplikasi, membekalkan perkakasan, peralatan dan perisian, melaksanakan pengurusan perubahan, pengurusan kualiti, melaksanakan penyelenggaraan pencegahan sebanyak 2x setahun sepanjang tempoh kontrak (setahun) serta melaksanakan perkhidmatan jaminan dan sokongan.</p><p>1.Isianpadu mencadangkan penyelesaian Commercially-Of-The-Shelves (COTS) daripada JurisTech yang terdiri daripada:</p><ul><li>﻿Juris Collect (J Collect)</li><li>Juris Agency (J Agency)</li><li>Juris Predator (J Predator)</li><li>Juris Legal (J Legal)</li><li>Juris Go (J Go)</li><li>Juris Concierge (J Concierge)</li><p><br></p></ul>', '<p level=\"1\" style=\"list-style-type: disc;margin-bottom:0cm;\"><span lang=\"EN-IN\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Pembangunan sistem aplikasi akan merangkumi aktiviti\npenyediaan pelan pembangunan sistem, kajian keperluan bisnes, kajian keperluan\nsistem, reka bentuk sistem termasuk arkitektur sistem, penentuan teknologi,\npangkalan data, antara muka pengguna, transaksi sistem, dan integrasi sistem dan tidak melibat sebarang migrasi data.</span></p><p><br></p>', '<p>Keseluruhan 6 syarikat telah menyertai tender ini dan Isianpadu berada di tangga ke 3 daripada 6 syarikat. Keterangan perbezaan harga adalah seperti berikut:</p><ol><li>Perbezaan harga Isianpadu dengan yang termurah adalah sebanyak 28% manakala kedua termurah pula adalah sebanyak 11% jurang perbezaan harga.</li><li>Isianpadu berkerjasama dengan JurisTech yang mempunyai pengetahuan yang luas berkenaan projek ini dan juga mencadangkan solusi yang terbaik bagi menjayakan projek ini.</li></ol><p>Status:</p><ol><li>Isianpadu shortlisted with very minimum information (20/9/2022)</li><li>Evaluation done. Winner will be awarded early october (22/9/2022)</li><li>This tender have been awarded to VMS (29/9/2022)</li></ol>', NULL, NULL, NULL, 'Lost to Variable Move Solution Sdn. Bhd. (RM4,122,221.28) Bidder with the lowest price selected by Mara', '2022-08-01 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
(131, 'UiTM/B1/PER/T/B/0522/0023', 'UITM WAF', 'CADANGAN MEMBEKAL, MENGHANTAR,\nMEMASANG, MENGUJILARI, DAN\nMENYELENGGARA WEB APPLICATION\nFIREWALL UNTUK PUSAT PEMULIHAN\nBENCANA UNIVERSITI, UITM KAMPUS\nSELAYANG, SELANGOR DARUL EHSAN', 0, 0, 14, 0, 0, 0, 5, NULL, 1, '2022-06-22', NULL, 996206.00, 856741.00, NULL, NULL, NULL, 2, 36, 996206, '2022-09-30', '<p style=\" margin-top: 0px; margin-bottom: 0.5rem; font-size: 0.875rem; line-height: 1.3rem; color: rgb(31, 31, 31); font-family: Nunito, sans-serif; font-style: normal; font-weight: 400; text-align: justify; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">Membekal, menghantar, memasang, mengujilari, dan menyelenggara Web Application Firewall untuk pusat pemulihan bencana Universiti, UiTM Kampus Selayang.&nbsp;</p><p style=\" margin-top: 0px; margin-bottom: 0.5rem; font-size: 0.875rem; line-height: 1.3rem; color: rgb(31, 31, 31); font-family: Nunito, sans-serif; font-style: normal; font-weight: 400; text-align: justify; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">SKOP TENDER:</p><ol style=\" margin-top: 0px; margin-bottom: 1rem; padding-left: 1rem; font-size: 0.875rem; color: rgb(31, 31, 31); font-family: Nunito, sans-serif; font-style: normal; font-weight: 400; text-align: justify; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\"><li style=\" line-height: 1.8;\">Membekal, mengkonfigurasi dan instalasi Fortinet FortiWeb&nbsp;di rangkaian pengguna.</li><li style=\" line-height: 1.8;\">Membekal perkhidmatan sokongan ﻿﻿dan memastikan bantuan sokongan dari pihak prinsipal dapat diberikan.</li><li style=\" line-height: 1.8;\">Melaksanakan perkhidmatan penyelenggaran pencegahan 4 kali setahun.</li></ol><p style=\" margin-top: 0px; margin-bottom: 0.5rem; font-size: 0.875rem; line-height: 1.3rem; color: rgb(31, 31, 31); font-family: Nunito, sans-serif; font-style: normal; font-weight: 400; text-align: justify; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">HARGA ISIANPADU:</p><p><span style=\"color: rgba(0, 0, 0, 0.87); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 13px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: nowrap; background-color: rgb(224, 224, 224); display: inline !important; float: none;\">996,206.00</span><br></p><p style=\" margin-top: 0px; margin-bottom: 0.5rem; font-size: 0.875rem; line-height: 1.3rem; color: rgb(31, 31, 31); font-family: Nunito, sans-serif; font-style: normal; font-weight: 400; text-align: justify; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\"><br></p>', '<p style=\" margin-top: 0px; margin-bottom: 0.5rem; font-size: 0.875rem; line-height: 1.3rem; color: rgb(31, 31, 31); font-family: Nunito, sans-serif; font-style: normal; font-weight: 400; text-align: justify; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">Isianpadu akan bekerjasama dengan Spectrum Edge bagi melaksanakan projek ini. SE akan membekal seperti berikut:</p><ol style=\" margin-top: 0px; margin-bottom: 1rem; padding-left: 1rem; font-size: 0.875rem; color: rgb(31, 31, 31); font-family: Nunito, sans-serif; font-style: normal; font-weight: 400; text-align: justify; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\"><li style=\" line-height: 1.8;\">﻿﻿FortiWeb-2000F</li><li style=\" line-height: 1.8;\">Upfront 3 Years 24x7 FortiCare Premium Support Subscription</li><li style=\" line-height: 1.8;\">Advance hardware replacement&nbsp;</li><li style=\" line-height: 1.8;\">Onsite support 24x7 program</li><li style=\" line-height: 1.8;\">Installation and setup&nbsp;</li><li style=\" line-height: 1.8;\"><span style=\" color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); float: none; display: inline !important;\">Non-certified training for 5 days @ SE office</span></li></ol>', '<p style=\" margin-top: 0px; margin-bottom: 0.5rem; font-size: 0.875rem; line-height: 1.3rem; color: rgb(31, 31, 31); font-family: Nunito, sans-serif; font-style: normal; font-weight: 400; text-align: justify; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">Sejumlah 12 buah syarikat telah mengambil bahagian dalam tender ini. Daripada jumlah itu, Isianpadu berada di tangga ke 6 dengan perbezaan sebanyak 14% dari harga yang termurah.&nbsp;</p><p style=\" margin-top: 0px; margin-bottom: 0.5rem; font-size: 0.875rem; line-height: 1.3rem; color: rgb(31, 31, 31); font-family: Nunito, sans-serif; font-style: normal; font-weight: 400; text-align: justify; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255);\">Untuk tender ini, Isianpadu telah membuat engagement dan harga yang telah disertakan adalah berdasarkan saranan.</p><ol><li>Isianpadu shortlisted to committee meeting﻿﻿<br></li><li>Waiting for UITM to release loa for the winner (20/9/2022)</li><li>End user still working on bond end contract. Vendor not yet received the sst. (30/9/2022)</li></ol>', NULL, NULL, '2022-10-07', 'ON GOING', '2022-08-02 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
(132, 'UITM/B1/PER/T/B/0522/0022', 'UITM IPS', 'CADANGAN MEMBEKAL, MENGHANTAR, MEMASANG, MENGUJILARI DAN MENYELENGGARA INTRUSION PREVENTION SYSTEM UNTUK UITM INTERNET GATEWAY (KLANG VALLEY DATA CENTER)', 0, 0, 14, 0, 0, 0, 6, NULL, 1, '2022-06-22', NULL, 2819197.00, 2593630.00, NULL, NULL, NULL, 2, 1, 2819157, '2022-08-02', '<p>Membekal, menghantar, memasang, mengujilari, dan menyelenggara Fortinet Intrusion Prevention System untuk UiTM Internet Gateway untuk tempoh 1 tahun.&nbsp;</p><p>SKOP TENDER:</p><ol><li>Membekal, mengkonfigurasi dan instalasi Fortinet IPS di rangkaian pengguna.</li><li>Membekal perkhidmatan sokongan ﻿﻿dan memastikan bantuan sokongan dari pihak prinsipal dapat diberikan.</li><li>Melaksanakan perkhidmatan penyelenggaran pencegahan 4 kali setahun.</li></ol><p>HARGA ISIANPADU:</p><p>Intrusion Prevention System (IPS) Appliance: 2,485,792.00</p><p>Intrusion Prevention System (IPS) Appliance: 311,626.00</p><p>Perkhidmatan Sokongan IT - Project Management: 21,739.00</p><p>Total: 2,819,157.00<br><br></p>', '<p>Isianpadu akan bekerjasama dengan Spectrum Edge bagi melaksanakan projek ini. SE akan membekal seperti berikut:</p><ol><li>﻿﻿Upfront 3 Years 24x7 FortiCare Premium Support Subscription for FortiGate-4400F &amp; FortiAnalyzer-1000F for 36 months</li><li>Onsite support 24x7 program</li><li>Installation and setup&nbsp;<span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">for FortiGate-4400F &amp; FortiAnalyzer-1000F</span></li><li><span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">Non-certified training for 5 days @ SE office</span></li></ol>', '<p>Sejumlah 9 buah syarikat telah mengambil bahagian dalam tender ini. Daripada jumlah itu, Isianpadu berada di tangga ke 2 dengan perbezaan sebanyak 4% dari harga yang termurah.&nbsp;</p><p>Untuk tender ini, Isianpadu telah membuat engagement dan harga yang telah disertakan adalah berdasarkan saranan.</p>', NULL, NULL, NULL, 'Won by Worxware Technologies Sdn Bhd (RM 2,889,800.00)', '2022-08-01 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
