(135, 'TENDER LHDNM (ICT) BIL.7/2022', 'LHDN Oracle Renewal License', 'PEMBAHARUAN LESEN DAN PERKHIDMATAN SOKONGAN PERISIAN, PERKAKASAN DAN PANGKALAN DATA ORACLE', 0, 0, 43, 0, 0, 0, 6, NULL, 7, '2022-07-25', NULL, 32178066.00, 28960259.00, NULL, NULL, NULL, 36, 36, 32178066, '2022-07-25', '<p style=\"text-align:justify;margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;\nline-height:107%;\">Memperbaharui lesen perisian versi yang terkini di LHDNM,\nmenyelenggara dan menyediakan khidmat sokongan perisian-perisian, perkakasan<span><span style=\"font-size:12.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;\">[1]</span></span>perkakasan dan\npangkalan data Oracle untuk tempoh tiga (3) tahun. </span></p><p><br></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">OBJEKTIF</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\"><br>Objektif tender adalah seperti berikut: </span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Memperbaharui lesen dan mendapatkan\nperkhidmatan sokongan perisian, perkakasan dan pangkalan data Oracle di Pusat\nData 1 (DC1) dan Pusat Data 2 (DC2) LHDNM. </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Memastikan perisian-perisian\nberoperasi secara sah dan mendapat khidmat sokongan dan penyenggaraan daripada\npihak prinsipal. </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Memastikan perkakasan-perkakasan\nmendapat khidmat sokongan dan penyenggaraan daripada pihak prinsipal.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Memastikan pangkalan data Oracle\nmendapat khidmat sokongan dan penyenggaraan daripada pihak prinsipal.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Memastikan kerja-kerja pembangunan\ndan operasi sistem HITS dan STAMPS berjalan tanpa gangguan. </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Memastikan sistem di Pusat Data 2\n(DC2) sentiasa dalam keadaan bai</span></p></li></ol><p><br></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">SKOP TENDER</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">Skop tender\nadalah seperti berikut: </span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Memperbaharui lesen Oracle dan\nmenyediakan khidmat sokongan dan penyelenggaraan perisian, perkakasan dan\npangkalan data Oracle untuk tempoh tiga (3) tahun;</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\"><span>&nbsp;</span>Senarai perisian-perisian adalah seperti\nberikut :</span></p><ol level=\"2\" style=\"list-style-type: lower-alpha;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Oracle Database Enterprise Edition</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Oracle Diagnostic Pack </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Oracle Tuning Pack</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Oracle Real Aplication Cluster</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Oracle Partitioning vi. Oracle Golden\nGate</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Oracle\nGoldenGate Foundation Suite</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Oracle GoldenGate for Non Oracle\nDatabase</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Oracle Data Integrator Enterprise\nEdition</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Oracle\nManagement Pack for Oracle Data Integrator</span></p></li></ol></li></ol><p><br></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\"><span>&nbsp;</span>Senarai perkakasan-perkakasan adalah seperti\nberikut :</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Server Exadata X8M-2 </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">ii. Backup Solution ZDLRA X8M</span></p></li></ol><p><br></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">Harga Isianpadu</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Software Support\nRenewal Data Centre 1 (DC1) &amp; Data Centre 2 (DC2) - RM17,560,487.00</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Hardware\nMaintenance Data Centre 1 (DC1) - RM6,371,980.00</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;color:black;\">Support\nServices for Engineered System Data Centre 1 (DC1) &amp; Data Centre 2 (DC2) - </span><span style=\"font-size:12.0pt;line-height:107%;\">RM8,245,599.00</span></p></li></ol><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:\n107%;color:black;\">JUMLAH\nKESELURUHAN - </span><b><span style=\"font-size:12.0pt;line-height:107%;\">RM32,178,066.00</span></b></p>', '<p>Isianpadu akan&nbsp; membuat \'back2back agreement\' dengan pihak Oracle bagi memenuhi keperluan MANDATORY LHDN bagi memastikan perlaksanaan projek ini akan berjalan lancar dan memenuhi jangkaan prestasi oleh pihak LHDN. Disamping itu kami akan memberikan tambah nilai dalam projek ini berdasarkan&nbsp; pengalaman &amp; kepakaran Oracle yang&nbsp; Isianpadu&nbsp; ada.</p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">Sejumlah 8\nsyarikat telah mengambil bahagian dalam tender ini. Harga Isianpadu paling\nmahal. Perbezaan harga yang agak jauh ini berdasarkan analisa kami adalah\nseperti berikut:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Ada kemungkinan bagi&nbsp; SUPPORT\nSERVICES&nbsp; pihak pesaing kami yang lain tidak membuat <span>&nbsp;</span>‘Back2Back agreement’ sepenuhnya dengan pihak\nOracle walaupun ianya adalah keperluan MANDATORY oleh LHDN. <span>&nbsp;</span>Sudah pasti tanpa ‘back2back agreement’ ini <span>&nbsp;</span>harga akan jauh lebih murah berbanding harga\nIsianpadu &amp; ianya boleh menjejaskan prestasi perlaksanaan kontrak ini\nkelak. Ini mungkin boleh dipastikan semasa \'Clarification session\' oleh pihak LHDN.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Kami mempunyai kakitangan dengan&nbsp; Oracle Certified&nbsp; yang berkemampuan untuk memberikan khidmat sokongan &amp; penyelenggaraan sendiri tapi oleh kerana keperluan LHDN yang mahukan back2back support dari prinsipal Oracle kami penuhi permintaan tersebut. Kami sertakan dokumen yang berkaitan dalam tender proposal kami.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Pihak kami juga bersedia untuk membuat rundingan harga dengan pihak LHDN sekiranya diberi peluang&nbsp; untuk melaksanakan projek ini.&nbsp;</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Kami yakin dengan pengalaman &amp; kepakaran kami&nbsp; lebih 15 tahun tahun&nbsp; melaksanakan &amp; menyelenggara produk Oracle seperti di PNB &amp; SSM , kami akan dapat&nbsp; memberikan yang terbaik bagi&nbsp; memenuhi kehendak LHDN.</span></p></li></ol><p>Status:</p><ol><li>Penilaian teknikal dan financial telah selesai. Menunggu keputusan dari lembaga tender. (20/9/2022)﻿﻿</li></ol>', NULL, NULL, NULL, 'Won by Statworks Technology Sdn Bhd @ 28,998,880', '2022-07-24 16:00:00', 0, 0, '0000-00-00 00:00:00', 0);
