&quot;,sans-serif;\"><span>23/08/2022 CSM send LOI for negotation</span></span></li><li><span lang=\"EN-US\" style=\"font-size:11.0pt;line-height:150%;font-family:\n&quot;Arial&quot;,sans-serif;\"><span>30/08/2022 online meeting for clarification and negotation.</span></span></li><li><span lang=\"EN-US\" style=\"font-size:11.0pt;line-height:150%;font-family:\n&quot;Arial&quot;,sans-serif;\"><span>Discuss for payment term 100%</span></span></li><li><span lang=\"EN-US\" style=\"font-size:11.0pt;line-height:150%;font-family:\n&quot;Arial&quot;,sans-serif;\"><span>Total submit CSM RM 82,680.00 inclusive of 6% sst, CSM requested for the discount price and both parties aggred with the final price RM80,000.00 inclusice 6% sst.</span></span></li><li><span lang=\"EN-US\" style=\"font-size:11.0pt;line-height:150%;font-family:\n&quot;Arial&quot;,sans-serif;\"><span>The LOA will be issue after submit the requirement document.</span></span></li><li><span lang=\"EN-US\" style=\"font-size:11.0pt;line-height:150%;font-family:\n&quot;Arial&quot;,sans-serif;\"><span>LOA already issue on 6 September 2022</span></span></li><li><font face=\"Arial, sans-serif\"><span style=\"font-size: 14.6667px;\">Kick-off Meeting 26/09/2022</span></font></li><li><font face=\"Arial, sans-serif\"><span style=\"font-size: 14.6667px;\">Received NDA 27/09/2022 and return back 28/09/2022</span></font></li><li><font face=\"Arial, sans-serif\"><span style=\"font-size: 14.6667px;\">Project start on 29 Nov 2022</span></font></li></ol>', NULL, NULL, '2022-09-06', 'submitted price include sst.\n23/8/2022 - Received LOI for negotiation\n6/9/2022 - Received LOA', '2022-07-31 16:00:00', 557000, 0, '0000-00-00 00:00:00', 0),
(143, 'QT220000000015565', 'TLDM RMN IRIS', 'PERKHIDMATAN MEMBEKAL, MEMBANGUN, MEMASANG, MENGINTEGRASI,\nMENGUJI, MENTAULIAH DAN MENYEDIAKAN LATIHAN BAGI ROYAL MALAYSIAN NAVY INTEGRATED READINESS\nINFORMATION SYSTEM (RMN IRIS) UNTUK TENTERA LAUT DIRAJA MALAYSIA (TLDM)', 0, 0, 52, 0, 0, 0, 6, NULL, 7, '2022-07-14', NULL, 25800000.00, 23900000.00, NULL, NULL, NULL, 24, 24, 25800000, '2023-01-01', '<p>Membekal, Membangun, Memasang, Mengintegrasi, Menguji, Mentauliah Dan Menyediakan Latihan Bagi Royal Malaysian Navy Integrated Readiness Information System (RMN IRIS) Untuk Tentera Laut Diraja Malaysia (TLDM) di 5 buah lokasi iaitu Main Data Center (MDC) KL, Data Distribution Center 1 (DDC1) K.Kinabalu,&nbsp;&nbsp;Data Distribution Center 2 (DDC2) Lumut, 10 buah Kapal, dan Markas dan Unit TLDM&nbsp;yang\ndirangkaian\nTLDMNet.</p><p>Objektif:</p><ol><li>Menyediakan cadangan keseluruhan bagi pembangunan Sistem RMN IRIS</li><li>Melaksanakan Big Data Analytics\n(BDA) TLDM dan&nbsp;pembangunan aplikasi Big Data Analytics (BDA) perlu menggunakan teknologi tempatan</li><li>﻿﻿Melaksanakan&nbsp;Disaster Recovery Management di Pusat Data TLDM serta panduan aktiviti\nbackup dan restore sistem RMN IRIS yang berada dalam persekitaran Data Recovery Center (DRC) yang terletak di Bahagian\nPengurusan Maklumat (BPM), MINDEF\n</li><li>Melaksanakan&nbsp;INDEPENDENT VERIFICATION AND VALIDATION (IVV)</li></ol><p>Skop Tender:</p><ol><li>RMN IRIS mempunyai 7 modul iaitu Logistik, Operasi, Sumber Manusia, Kewangan, Strategik, Pentadbiran dan Dashboard. Setiap modul mempunyai sub-modul yang berbeza. ﻿﻿</li><li>RMN IRIS juga merangkumi beberapa fasa iaitu Perkhidmatan&nbsp;<span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">Penyediaan</span> Infrastruktur, Pembangunan Sistem Aplikasi, Perkhidmatan Penyediaan Cadangan, Perkhidmatan dan Perkhidmatan IV&amp;V.</li><li>Tender ini mengandungi keperluan perkakasan dan keperluan perisian yang akan diagihkan mengikut beberapa penempatan yang berbeza.</li><li>Tempoh pelaksanaan adalah 2 tahun.</li><li>Tempoh jaminan perkakasan dan perisian adalah 3 tahun, manakala tempoh jaminan sistem aplikasi adalah 1 tahun.</li><ol><p><br></p></ol></ol>', '<p>Plan:</p><ol><li>Isianpadu akan bekerjasama bersama United Allied Business (UAB) ﻿﻿dan merangka kerja-kerja berdasarkan fasa-fasa yang tersenarai di atas mengikut kepada kepakaran syarikat.</li></ol>', '<p>Strategi:</p><p>Bagi tender ini, sejumlah 34 buah syarikat telah mengambil bahagian. Daripada jumlah itu, Isianpadu berada di tangga ke 24 daripada 34 company. Berdasarkan analisa yang telah dibuat, sebanyak 20 buah syarikat yang telah menyertai tender ni mempunyai perbezaan 10% ke bawah daripada harga Isianpadu. Jelas, persaingan harga yang rapat diantara syarikat-syarikat yang telah mengambil bahagian.</p><p>Winning Strategi:</p><ol><li>Isianpadu akan bekerjasama dengan UAB dimana UAB mempunyai kekuatan dari segi informasi yang mendalam selain mereka juga mengetahui solusi yang terbaik / yang diminta oleh pengguna akhir.</li><li>Isianpadu juga telah melakukan \"engagement\" dari \"top to bottom\".&nbsp; Solusi yang ditawarkan seharusnya menepati spesifikasi cadangan dari pihak pengguna.</li><li>Isianpadu juga bekerjasama bersama mimos untuk tender ini dimana mimos juga adalah \"recommended\" dari pada pihak pengguna. ﻿﻿</li></ol>', NULL, NULL, NULL, 'Awarded to Tulip Resources (RM 25,515,199.00)', '2022-07-27 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
(144, '', 'PNB FDS Renewal (Oracle Software ) 2023-2025', '', 0, 0, 17, 0, 0, 0, 6, NULL, 2, '0000-00-00', NULL, 12000000.00, 10800000.00, NULL, NULL, NULL, 0, 0, 0, '0000-00-00', '', '', '', NULL, NULL, NULL, '1/8/2022 - price submitted to PNB\n- 3 years renewal (2023-2025)\n- PNB will decide whether renew via Isianpadu or direct to Oracle\n27/10/2022 - Lost - PNB direction to renew direct to Oracle', '0000-00-00 00:00:00', 7495, 0, '0000-00-00 00:00:00', 0);
