UI&quot;,sans-serif;\">Jemaah\nNazir </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Bahagian\nAudit Sekolah</span></p></li></ol><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Harga Isianpadu:</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Perisian: RM 4,530,000.00</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Perkhidmatan: RM 219,999.99</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Harga keseluruhan: RM 4,749,999.99</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Isianpadu akan membuat\nperjanjian (back-to-back agreement) dengan pihak prinisipal bagi memenuhi\nkeperluan mandatori KPM bagi memastikan pelaksanaan projek ini akan berjalan\nlancar dan memenuhi jangkaan prestasi oleh pihak KPM.</span> Disamping itu\njuga, kami akan memberikan tambah nilai dalam projek ini berdasarkan pengalaman\n&amp; kepakaran pihak principal yang juga merupakan incumbent dalam projek ini.</p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Sejumlah 42 syarikat\ntelah mengambil bahagian dalam tender ini. Harga Isianpadu adalah di tangga ke 16.\nPerbezaan harga yang agak jauh ini adalah berdasarkan Analisa kami seperti\nberikut:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Ada\nkemungkinan pihak pesaing kami menawarkan solution yang berbeza tetapi tidak\ndapat mematuhi keseluruhan requirement dari KPM. Berdasarkan Analisa kami, kami\nmenawarkan solution yang dapat memenuhi keperluan KPM.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Perisian\nyang dicadangkan juga tersenarai dalam Gartners\'s Magic Quadrant for Unified\nEndpoint Management Tools sekurang-kurangnya sekali dalam tempoh 3 tahun\nterkini (2019 hingga terkini) dimana ianya adalah satu keperluan mandatori dari\npihak KPM yang perlu dipatuhi.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Berdasarkan\nperbincangan bersama pihak distributor, pihak kami juga bersedia untuk membuat\nrundingan harga dengan pihak KPM sekiranya diberi peluang untuk melaksanakan projek\nini.</span></p></li></ol>', NULL, NULL, NULL, 'Lost to AR-RIFQI SDN. BHD.', '2022-08-18 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
(194, 'QT220000000023218', 'MOE LEASING PDP PHASE 2', 'PERKHIDMATAN SEWAAN PERKAKASAN ICT SECARA SEWA GUNA (LEASE TO USE) UNTUK KEPERLUAN PENGAJARAN DAN PEMBELAJARAN (PDP) DI MAKMAL SEKOLAH-SEKOLAH KPM FASA 2 (ZON 7: PAHANG)', 0, 0, 22, 0, 0, 0, 6, NULL, 1, '2022-08-18', NULL, 45091740.00, 40567658.00, NULL, NULL, NULL, 4, 60, 45091740, '2023-01-01', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;color:#333333;background:white;\">Perkhidmatan\nsewaan peralatan ICT secara sewa guna (lease to use); dengan tempoh kontrak\nselama 65 bulan termasuk 4 bulan tempoh pembekalan, pemasangan, pengujian dan\npentauliahan, 60 bulan tempoh sewaan dan 1 bulan tempoh pemulangan bagi setiap\nsenarai perkakasan.</span></p><p><br></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;color:#333333;background:white;\">Objektif:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Menghantar perkakasan ICT di semua terlibat serta\nmendapatkan pengesahan penerimaan pihak KPM</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Memasang, mengkonfigurasi dan menguji lari\nsemua peralatan yang dibekalkan melibatkan kerja-kerja pemasangan perisian antivirus\nyang dibekalkan dan memasang perisian otomasi pejabat sumber terbuka yang\ndikenal pasti oleh KPM</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Mentauliah semua perkakasan yang dibekalkan dengan\nmelengkapkan borang Sijil Pengujian dan Pentauliahan (SPP)</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Melaksanakan penyelenggaraan perkakasan dan\nperisian sebanyak 1 kali setahun selama tempoh kontrak iaitu 5 tahun.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Menyediakan jaminan perkakasan ICT daripada\nprinsipal sepanjang tempoh sewaan</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Menyediakan pengurusan aduan/meja bantuan\n(hepdesk) menurut keperluan KPM</span></p></li></ol><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span>Senarai perkakasan:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Komputer Riba Biasa (6790 unit)</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Pencetak Multifunction (347 unit)</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Projektor (339 unit)</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Charging Cart (317 unit)</span></p></li></ol><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span>Senarai Perisian:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Antivirus (6790 unit)</span></p></li></ol>', '<p><span style=\"font-size:10.5pt;line-height:107%;\nfont-family:&quot;Calibri&quot;,sans-serif;color:#333333;background:white;\">Isianpadu akan\nmembuat perjanjian dengan pihak prinisipal &amp; distributor bagi memenuhi\nkeperluan mandatori KPM bagi memastikan pelaksanaan projek ini akan berjalan\nlancar dan memenuhi jangkaan prestasi oleh pihak KPM</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;color:#333333;background:white;\">Sejumlah\n117 syarikat telah mengambil bahagian dalam tender ini. Harga Isianpadu adalah\ndi tangga ke 87. Perbezaan harga yang agak jauh ini adalah berdasarkan Analisa kami\nseperti berikut:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Ada kemungkinan pihak pesaing kami menawarkan\nbrand yang lebih murah dari segi harga tetapi tidak dapat mematuhi keseluruhan requirement\ndari KPM. Berdasarkan Analisa kami, kami menawarkan brand yang mempunyai\nreputasi yang tinggi dan juga mampu memenuhi keperluan KPM dari segi lead time.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Kami juga telah meneliti setiap kemungkinan\nadanya “hidden item” seperti pembekalan toner 2 set setiap tahun untuk pencetak\nMultifunction, antivirus dan cable lock bagi Komputer Riba, dan security lock bagi\ncharging cart. Ada kemungkinan juga pihak pesaing kami tidak menawarkan “hidden\nitem” seperti yang dinyatakan.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span>Kami juga menawarkan harga yang menepati\nberdasarkan bajet yang diperlukan oleh KPM</span></p></li></ol><p>Status terkini:</p><ol><li>Keputusan akan dibuat pada 15th November 2022. Isianpadu telah disenarai pendek</li></ol>', NULL, NULL, NULL, 'Awarded to Statworks Technology Sdn Bhd @ RM 43,738,200.00', '2022-08-21 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
(195, 'QT220000000022903', 'MOE LEASING PDT PHAZE 3 ZON TIMUR', 'TENDER PERKHIDMATAN SEWAAN PERKAKASAN ICT SECARA SEWA MILIK (LEASE TO OWN) UNTUK KEPERLUAN PENGURUSAN DAN PENTADBIRAN (PDT) DI AGENSI, JABATAN PENDIDIKAN NEGERI (JPN) DAN PEJABAT PENDIDIKAN DAERAH (PPD) BAGI KEMENTERIAN PENDIDIKAN MALAYSIA (FASA 3) : ZON TIMUR', 0, 0, 22, 0, 0, 0, 6, NULL, 1, '2022-08-18', NULL, 28534848.00, 25179308.00, NULL, NULL, NULL, 12, 48, 28534848, '2023-01-02', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Perkhidmatan sewaan\nperalatan ICT secara sewa beli (lease to own); dengan tempoh kontrak selama 51\nbulan termasuk 3 bulan tempoh pembekalan, pemasangan, pengujian dan\npentauliahan, dan 48 bulan tempoh sewaan.</span></p><p><br></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Objektif:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Menghantar\nperkakasan ICT di semua terlibat serta mendapatkan pengesahan penerimaan </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Memasang,\nmengkonfigurasi d