(196, 'SH/PTGS/16/2022', 'SEBUT HARGA PEROLEHAN PERKHIDMATAN PENYELENGGARAAN BAGI PELAYAN-PELAYAN DI PEJABAT TANAH DAN GALIAN NEGERI SELANGOR (PTGS) DAN 9 PEJABAT DAERAH DAN TANAH (PDT) NEGERI SELANGOR SELAMA TEMPOH SATU (1) T', 'SEBUT HARGA PEROLEHAN PERKHIDMATAN PENYELENGGARAAN BAGI PELAYAN-PELAYAN DI PEJABAT TANAH DAN GALIAN NEGERI SELANGOR (PTGS) DAN 9 PEJABAT DAERAH DAN TANAH (PDT) NEGERI SELANGOR SELAMA TEMPOH SATU (1) TAHUN', 0, 0, 62, 0, 0, 0, 6, NULL, 9, '2022-08-23', NULL, 198220.00, 185220.00, NULL, NULL, NULL, 4, 12, 198220, '2022-12-01', '<p><span lang=\"EN-US\" style=\"font-size:11.0pt;font-family:\n&quot;Arial&quot;,sans-serif;\">Pihak kami akan\nmemberi Perkhidmatan Penyelenggaraan Pelayan-Pelayan Di Pejabat Tanah Dan\nGalian Negeri Selangor (PTGS) Dan 9 Pejabat Daerah Dan Tanah (PDT) Negeri\nSelangor Selama Tempoh Satu (1) Tahun bagi semua pelayan-pelayan (40 unit\npelayan keseluruhan) yang ditempatkan di PTGS dan 9 PDT Negeri Selangor </span><br></p>', '<ol start=\"1\" type=\"1\" style=\"margin-top:0cm;margin-bottom:0cm;\">\n<li style=\"text-align:justify;margin:0cm;font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\"><span lang=\"EN-US\" style=\"font-size:11.0pt;\nfont-family:&quot;Arial&quot;,sans-serif;\">Melaksanakan Penyelenggaraan Pencegahan (<i>Preventive Maintenance</i>) bagi\nPelayan-Pelayan Di Pejabat Tanah Dan Galian Negeri Selangor (PTGS) Dan 9\nPejabat Daerah Dan Tanah (PDT) Negeri Selangor sebanyak satu (1) kali\nselama tempoh kontrak berkuatkuasa;</span></li>\n</ol><p><br></p><ol start=\"2\" type=\"1\" style=\"margin-top:0cm;margin-bottom:0cm;\">\n<li style=\"text-align:justify;margin:0cm;font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\"><span lang=\"EN-US\" style=\"font-size:11.0pt;\nfont-family:&quot;Arial&quot;,sans-serif;\">Melaksanakan Penyelenggaraan Pembaikan (<i>Corrective Maintenance</i>) Pelayan-Pelayan\nDi Pejabat Tanah Dan Galian Negeri Selangor (PTGS) Dan 9 Pejabat Daerah\nDan Tanah (PDT) Negeri Selangor termasuk menukar alat ganti dan perkakasan\npelayan yang rosak tanpa had selama tempoh kontrak berkuatkuasa mengikut <i>Service Level Agreement (SLA)</i> yang\ntelah dipersetujui;</span></li>\n</ol><p><br></p><ol start=\"3\" type=\"1\" style=\"margin-top:0cm;margin-bottom:0cm;\">\n<li style=\"text-align:justify;margin:0cm;font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\"><span lang=\"MS\" style=\"font-size:11.0pt;font-family:\n&quot;Arial&quot;,sans-serif;\">Memberi perkhidmatan sokongan\noperasi dan bantuan teknikal kepada PTGS selama tempoh satu (1) tahun dan\nsemasa tempoh waranti peralatan berkuatkuasa;</span></li>\n</ol><p><br></p><ol start=\"4\" type=\"1\" style=\"margin-top:0cm;margin-bottom:0cm;\">\n<li style=\"text-align:justify;margin:0cm;font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\"><span lang=\"MS\" style=\"font-size:11.0pt;font-family:\n&quot;Arial&quot;,sans-serif;\">Melaksanakan semua skop\nperkhidmatan seperti yang disenaraikan di Jadual 1: Jadual Pematuhan\nSpesifikasi Umum dan Jadual 2: Jadual Pematuhan Spesifikasi Teknikal.</span></li>\n</ol>', '<ul><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Mulakan Slide Presentation</p></li><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Piagam Projek</p></li><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Laporan Pengurusan</p></li><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Laporan Penilaian Aplikasi Web</p></li><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Laporan Ujian Penembusan Dalaman Keselamatan Rangkaian</p></li><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Laporan Ujian Penembusan Luar Keselamatan Rangkaian</p></li><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Laporan Penilaian Konfigurasi Peranti Perimeter Rangkaian</p></li><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Laporan Kajian Seni Bina Rangkaian</p></li><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Laporan Penilaian Pasca</p></li><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Bengkel Pengerasan</p></li><li style=\"text-align: justify;\"><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\">Latihan</p></li></ul><p><br><span>1)Done submit Hardcopy</span></p><p>2) 19/9/2021 no update ranking at website</p><p>3) 30/11/2022 already award to Isticomm Solution Sdn Bhd</p><p><a classname=\"e-rte-anchor\" href=\"https://ptg.selangor.gov.my/index.php/pages/view/48\" title=\"https://ptg.selangor.gov.my/index.php/pages/view/48\" target=\"_blank\">https://ptg.selangor.gov.my/index.php/pages/view/48 </a></p>', NULL, NULL, NULL, '1)Done submit Hardcopy\n2) 19/9/2021 no update ranking at website\n3) 30/11/2022 already award to Isticomm Solution Sdn Bhd\nhttps://ptg.selangor.gov.my/index.php/pages/view/48', '2022-08-22 16:00:00', 557000, 0, '2028-03-02 16:00:00', 0),
