(200, '086/2022/32', 'MARA PABX SYSTEM MAINTENANCE', 'SEBUT HARGA KALI KEEMPAT\nCADANGAN PEROLEHAN\nPERKHIDMATAN SOKONGAN DAN\nSELENGGARAAN PERKAKASAN DAN\nPERISIAN BAGI SISTEM IP-PABX DI\nIBU PEJABAT MARA', 0, 0, 13, 0, 0, 0, 6, NULL, 9, '2022-08-30', NULL, 495550.00, 409000.00, NULL, NULL, NULL, 12, 12, 459550, '2023-01-02', '<p>Perkhidmatan Sokongan Dan Selenggaraan Perkakasan Dan Perisian Bagi Sistem IP-PABX\ndi Ibu Pejabat Mara bagi kali ke empat untuk tempoh setahun (12 bulan).</p><p><br>OBJEKTIF</p><p>Objektif tender adalah seperti berikut:</p><ol style=\"list-style-image: none; list-style-type: lower-roman;\"><li>Pengurusan Aduan (Helpdesk)&nbsp;</li><li>Penyelenggaraan pencegahan&nbsp;</li><li>Penyelenggaraan pembaikan&nbsp;</li><li>Health Check&nbsp;</li><li>Khidmat sokongan teknikal dan nasihat&nbsp;</li><li>Service Level Agreement (SLA)&nbsp;</li><li>Latihan&nbsp;</li><li>Dokumentasi</li></ol><p><br></p><p>Harga Isianpadu:</p><p>Penyelenggaraan Pencegahan (Preventive Maintenance) dan Penyelenggaraan Pembaikan (Corrective Maintenance): RM 459,550.00</p><p><br></p>', '<p>Perkhidmatan penyelenggaran yang\nakan kami sediakan adalah perkhidmatan penyelenggaraan pencegahan dan baik pulih\nsecara komprehensif. Perkhidmatan Penyelenggaraan Pencegahan (Preventive Maintenance\nService) akan kami lakukan mengikut jangka masa yang ditetapkan sebanyak dua (2) kali\nsetahun untuk tempoh satu (1) tahun. Sementara Perkhidmatan Penyelenggaran Pembaikan\n(Corrective Maintainance) yang kami sediakan adalah mengikut keperluan dengan masa dan\ntiada had dalam kekerapan perkhidmatan ini diperlukan sepanjang tempoh perkhidmatan.<br></p>', '<p>Sejumlah 3 syarikat telah mengambil bahagian dalam sebutharga ini. IPS berada di kedudukan 2 dari 3.&nbsp;</p><ol><li>Harga termurah adalah RM ﻿﻿307,454.00.&nbsp;<br></li></ol>', NULL, NULL, NULL, '3 company participated. IPS is second lowest. The cheapest is RM 307,454.00', '2022-08-29 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
(201, 'DOC 3606837833', 'RFP OKI Maint', 'OKI PRINTERS MAINTENANCE IN EPF', 0, 0, 41, 0, 0, 0, 6, NULL, 9, '2022-09-01', NULL, 920743.00, 805561.00, NULL, NULL, NULL, 12, 1, 920743, '2023-01-02', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">To maintain\nthe printers for a period of one (1) year with option to extend for another one\n(1) year</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">Scope\nTender:</span></p><ol level=\"1\" style=\"list-style-type: lower-roman;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Provide\nsupport/maintenance services for OKI printer and carry out repair activities\nincluding replacement of printer components and consumables parts </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Replacing\ndefective equipment or spare parts with genuine or equivalent parts. </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">We\nwill list unsupported items/parts/components (with the price) during the implementation\nof the technical support service and repair of the printers throughout the\ncontract period </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Provide\ntroubleshooting, fixing, technical support and testing.</span></p></li></ol><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">Isianpadu Submission\nPrice:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Maintenance<span>&nbsp; </span>Cost: RM 920,743.00</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Parts Not Covered: RM 15,510.00</span></p></li></ol>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">We are\ndedicated in extending full support to KWSP and to ensure KWSP meets its\nbusiness objectives. We working closely with e-maintenance (OKI service\nprovider) for this tender. </span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">We are ready\nto negotiate price with EPF. Beside that, we will also make b2b agreement with\nOKI to ensure that the process of providing maintenance and support will run\nsmoothly.</span></p>', NULL, NULL, NULL, 'Awarded to Venture Nucleus (M) Sdn Bhd', '2022-09-11 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
