ernally, to\nidentify security threats and vulnerabilities </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">To\ncomply with ISO 27002 or NIST 800-53 requirement during implementing\nvulnerability assessment</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">To\nuse proactive approach in the process of identifying vulnerabilities.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">To\nhave access to security specialists for advice on security vulnerabilities and\ntheir <span>&nbsp;</span>corresponding countermeasures.</span></p></li></ol><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Isianpadu Price bidding:</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Total: RM 56,500.00</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">The duration allocated for\nthe implementation of this project is 1 month. Isianpadu will work closely with\nAsk.pentest in other to ensure the project will be run smoothly and meet the\nIAB expectation. We also will provided added value where we will propose transfer\nof knowledge during the project that will be conducted by Ask.pentest. Proposed\nprogramme is Hardening Workshop and Penetration Testing Training 1 Class</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">There are a total of 10 bidders\nparticipate for this sebutharga. IPS rank is 5 over 10. Our analysis as per\nbelow:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">IPS has done from bottom to top level\nengagement with end user. We bid the price as suggested and according to their\nbudget.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">We believe our competitors go with lower price.\nSome known competitors in IAB are Ofisgate and Poketdata.</span></p></li></ol><p>Status:</p><ul><li>Evaluation both technical and financial done. We scored 6/10 for technical &amp; 7/10 for financial. This is due to few technical cert (CCIE and OSCP) that our partner couldn\'t provide (5/10/2022)</li><li>IPS shortlisted along with another 5 company. Meeting committee will be held on 12th October. (7/10/2022)</li></ul>', NULL, NULL, NULL, 'Lost to Rifhan Technology.', '2022-09-29 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
