-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">iMaster NCE Campus Insight</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">LCD KVM Switch</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">Uninterruptible Power Supply (UPS)</span></p></li></ol><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Harga Isianpadu:</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Harga Keseluruhan: RM 4,282,282.00</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Tempoh pelaksanaan:</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Tempoh pelaksanaan menaik\ntaraf, pembekalan, pemasangan, konfigurasi, ujilari dan pentauliahan projek ini\nadalah selama lapan (8) bulan dari tarikh mula kontrak.</span></p><p style=\"margin-left:36.0pt;margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;\nline-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;color:#333333;background:\nwhite;\">a) Pembekalan, pemasangan dan konfigurasi – Dalam masa empat (4) bulan\ndari tarikh mula kontrak.</span></p><p style=\"margin-left:36.0pt;margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;\nline-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;color:#333333;background:\nwhite;\">b) Ujilari dan pentauliahan projek – Dalam masa lapan (8) bulan dari\ntarikh mula kontrak.</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Sejumlah 44 syarikat\ntelah mengambil bahagian dalam tender ini. Harga Isianpadu adalah di tangga ke 16.\nPerbezaan harga yang agak jauh ini adalah berdasarkan Analisa kami seperti\nberikut:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Ada\nkemungkinan pihak pesaing kami menawarkan solution yang berbeza tetapi tidak\ndapat mematuhi keseluruhan requirement dari KPM. Berdasarkan Analisa kami, kami\nmenawarkan solution yang dapat memenuhi keperluan KPM (Huawei).</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Produk\nyang telah dicadangkan juga telah tersenarai dalam laporan Magic Quadrant for\nthe Wired and Wireless LAN Access Infrastructure yang terbaru dikeluarkan oleh\nGartner dimana ianya adalah satu keperluan mandatori dari pihak KPM yang perlu\ndipatuhi.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Berdasarkan\nperbincangan bersama pihak distributor, pihak kami juga bersedia untuk membuat\nrundingan harga dengan pihak KPM sekiranya diberi peluang untuk melaksanakan\nprojek ini.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">IPS\nberkerjasama dengan partner (SAF) dimana mereka telah melakukan “top bottom engagement”\ndengan KPM</span></p></li></ol>', NULL, NULL, NULL, 'awarded to E- CONTENT (M) SDN. BHD. @ RM3,855,114.00', '2023-01-11 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
