t:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Harga Isianpadu: RM 3,797,603.00</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;\">Project implementation:</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">The duration of the\nimplementation proposed for this project is 9 month. Isianpadu We work<span>&nbsp; </span>closely<span>&nbsp;\n</span>and<span>&nbsp; </span>collaborate<span>&nbsp; </span>with<span>&nbsp;\n</span>all<span>&nbsp; </span>product principal that\ninvolved in this solution such as HPE, CISCO, and VMware to make sure this\nproject successfully implement follow on requirement from UiTM. We also\nproposed training and certification as below:</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">• VMware vSphere: Install,\nConfigure, Manage for 5 pax for 5 days</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">• Microsoft Certified:\nWindows Server<span>&nbsp; </span>Hybrid<span>&nbsp; </span>Administrator Associate: AZ-800 for 5 pax for\n4 days</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">There are a total of 23\nbidders participate for this sebutharga. IPS rank is 14 over 23 overall. Our\nanalysis as per below:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">IPS has done from bottom to top level\nengagement with end user. We bid the price as suggested and according to their\nbudget. Our ranking based on variance is 3/13 as the rest bidding price is out\nof variance.&nbsp;</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;color:#333333;\nbackground:white;\">We believe our submission price is <br>competitive as we have allocate around 15% of\nmargin and within the variance</span></p></li></ol>', NULL, NULL, NULL, 'Awarded to Angkatan Dinamik Sdn Bhd', '2023-01-25 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
