(540, '21 01 02, 21 01 03, 21 01 06, 22 05 03, 21 01 09, 21 01 04, 21 01 05', 'PENDIGITALAN LESEN MEMANDU MALAYSIA (eLMM), LESEN KENDERAAN MOTOR (eLKM) DAN PENGUATKUASAAN BERSEPADU', 'DESIGN, DEVELOP, INSTALL, CONFIGURE, TESTING, COMMISSION AND PROVISION OF SUPPORT & MAINTENANCE FOR THE DIGITALISATION OF LESEN MEMANDU MALAYSIA (ELMM), LESEN KENDERAAN MOTOR (ELKM) DAN PENGUATKUASAAN BERSEPADU', 0, 0, 15, 0, 0, 0, 6, NULL, 5, '2023-04-06', NULL, 247474474.00, 216364376.00, NULL, NULL, NULL, 36, 36, 247474474, '2023-08-31', '<p style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\">With the implementation of the project, JPJ intend to\nrealize these objectives:</p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Digitize\nthe controlled documents of Malaysian Driving License (LMM) and Motor Vehicle\nLicense (LKM) by upgrading the mySIKAP system including with additional\nchannels via counter, mobile application and public portal.</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Implement\nintegrated enforcement via</p></li><ol level=\"2\" style=\"list-style-type: lower-alpha;margin-bottom:0cm;\"><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Upgrading\nthe SmED, AwAS and integration with relevant subsystems</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Acquisition\nof Automated Number Plate Recognition (ANPR) system hardware</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>new\nprocurement of network equipment, storage, software and upgrading of Control\nCenters.</p></li></ol></ol><p><br></p><p><br></p>', '<p>12 months implementation. 24 months maintenance and support.</p><p>The scope of work for the project is as follows:</p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>To\ndesign, develop, deliver, integrate, test and deploy ‘Pendigitalan Lesen\nMemandu Malaysia (eLMM), Lesen Kenderaan Motor (eLKM) Dan Penguatkuasaan\nBersepadu’ based on standard software development practices.</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Network\nand security services which includes:</p><ol level=\"2\" style=\"list-style-type: lower-alpha;margin-bottom:0cm;\"><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>End\nto end telecommunication network subscription</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>M2M\nGateway </p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>LTE\nModem </p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>WAF</p></li></ol></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Data\nCenter and Data Recovery Center which includes maintenance services, disaster\nrecovery testing and system hardening.</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Security\nPosture Assessment services</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Performance\nMonitoring Tools</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>ICT\nhardware rental services and enforcement equipment which includes</p><ol level=\"2\" style=\"list-style-type: lower-alpha;margin-bottom:0cm;\"><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Desktop\nPC x 29</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Notebook\nx 10</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Color\nLaser Printer x 6</p></li><li style=\"margin-top:6.0pt;margin-righ