-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>Service\non request</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>To\nprovide project management services to ensure the project is properly managed\nso that it will be delivered within the given time frame and budget.</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>To supply\nsoftware to be used by the system.</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>To provide\ndata migration and data initialization for the proposed system.</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>To perform\ndata and service integration between the proposed system and other system\n(internal within JPJ and with other external parties).</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>To provide\nservices in the area of Testing, Change Management, Training and Transfer of\nTechnology (TOT).</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>To provide\ndocumentation.</p></li><li style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:12.0pt;margin-left:36.0pt;text-align:justify;font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;background:white;\"><p>To provide\nwarranty, maintenance and support services which includes Helpdesk services</p></li></ol>', '<p>a&nbsp; Pricing strategy within the budget variance of +-10%</p><p>b) Coverage at every level of the bid</p>', NULL, NULL, NULL, 'IPS price ranked 7/25.\nCheapest at 220M - AIMS\nPOC on the 12th July 2023\n15 co technically shortlisted as below:\n1.Tridimas -14\n2.Datasonic - 8\n3.Niellsen - 15\n4.Handal - 6\n5.Aims solution - 13\n6.Sandata - 11\n7.Grayscale -10\n8.Tc Sens - 3\n9. Knight electr', '2023-04-05 16:00:00', 65653, 0, '0000-00-00 00:00:00', 0),
