(556, 'JPVSEL/T/01/2023', 'TENDER PEROLEHAN PERKHIDMATAN SEWAAN UNTUK MEMBEKAL, MENGHANTAR, MEMASANG, MENGUJI DAN MENTAULIAH PERKAKASAN ICT SECARA KONTRAK DENGAN KHIDMAT SOKONGAN DAN JAMINAN DI JABATAN PERKHIDMATAN VETERINAR NE', 'TENDER PEROLEHAN PERKHIDMATAN SEWAAN UNTUK MEMBEKAL, MENGHANTAR, MEMASANG, MENGUJI DAN MENTAULIAH PERKAKASAN ICT SECARA KONTRAK DENGAN KHIDMAT SOKONGAN DAN JAMINAN DI JABATAN PERKHIDMATAN VETERINAR NEGERI SELANGOR BAGI TEMPOH TIGA (3) TAHUN BERMULA 1 SEPTEMBER TAHUN 2023 HINGGA 31 OGOS TAHUN 2026.', 0, 0, 166, 0, 0, 0, 6, NULL, 1, '2023-06-06', NULL, 2799188.00, 2754490.00, NULL, NULL, NULL, 1, 36, 2800000, '2023-09-01', '<p>Tender Perolehan Perkhidmatan Sewaan Untuk Membekal, Menghantar, Memasang, Menguji Dan Mentauliah Perkakasan Ict Secara Kontrak Dengan Khidmat Sokongan Dan Jaminan Di Jabatan Perkhidmatan Veterinar Negeri Selangor Bagi Tempoh Tiga (3) Tahun Bermula 1 September Tahun 2023 Hingga 31 Ogos Tahun 2026.</p>', '<ul><li>Implementation 1 months</li><li>Kontrak 36 months</li><li>11 location within Selangor only</li><li>CM</li><li>PM 3 times per year</li></ul>', '<ul><li>PC quantity 226 unit with microsoft and antivirus bitdefender, NB quantity 18 unit&nbsp;<span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">with microsoft and antivirus bitdefender, HP printer&nbsp;</span>Mono A4 quantity 84 unit and HP Printer Warna 3 in 1 quantity 42 unit.</li><li>Actualy customer wanted the HDMS and they bundle it with hardware.&nbsp;&nbsp;</li><li style=\"line-height: 1.8;\">Partner Anacle Data is a principal for asset management systems HDMS (Helpdesk Management Systems)﻿﻿, they already propose their system to JPVSEL</li><li>Working with Anacle and they already done the budgetary with PC NB Lenovo,Printer HP, Microsoft,Antivirus Bitdefender</li><li><span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">Anacle</span>&nbsp;already give us the draft agreement for us to sign, before they release the price and doc to us, the agreement draft already pass to legal En Azizi to go trough.</li><li><span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">Anacle</span>&nbsp;also working with disti TecD , partner ask disti to allocate 3 company to participate the tender and commit ,the company is Isianpadu,Examedia &amp; Qinetics Solution</li><li>Partner guarantee 2 weeks after submission 3 of this company will 33.33% shorlisted</li><li>Budget is about RM 2.8mil margin around 300k.</li><li>Partner suggest we can deliver half quantity for microsoft that means the margin will increase a bit.</li><li>Isianpadu top management support needed.</li><li>Sales person incharge for this tender is Iffa Inani.</li></ul>', NULL, NULL, NULL, '- Submission hardcopy\n- price ranking 7/17 (below us price follow indicatif)\n9/8 - Unconfirmed info, IPS lost to Juricho', '2023-05-29 16:00:00', 557000, 0, '0000-00-00 00:00:00', 0),
