nt-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;\nfont-family:&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Antivirus\n(Bitdefender GravityZone Business Solutions)</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;\nfont-family:&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Microsoft\nOffice (Microsoft Office 365 A1)</span></p></li></ul><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">Menyediakan unit gantian sementara dalam tempoh\n30 hari selepas surat pemakluman kepada syarikat </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">Melaksanakan perkhidmatan penyelenggaraan\npencegahan (Preventive Maintenance) secara berkala iaitu dua (2) kali setahun\nuntuk tempoh 60 bulan</span></p></li></ol>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Tempoh pelaksanaan:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">Tempoh kontrak ini adalah untuk tiga 3 tahun\ntiga 3 bulan.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">Pembekalan, pemasangan dan konfigurasi – Dalam\nmasa tiga (3) bulan dari tarikh mula kontrak.</span></p></li></ol>', '<p style=\"margin-top:6.0pt;margin-right:0cm;margin-bottom:6.0pt;\nmargin-left:0cm;line-height:150%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:\n150%;font-family:&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">For this\ntender, we participate with Lenovo as we have set the strategy together before\nthe tender out. We will also leverage for Lenovo leasing facilities which cost\n<strong>3.12%</strong> per annum where cheaper than 3rd party rate. For the services as well,\nLenovo will commit the staging, image, delivery and maintenance. Lenovo is\ncommitted to deliver their products withing <strong>3-5 weeks</strong>. For this zone, we bid\nwith variance of <strong>-10%.</strong></span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Submission value\nIsianpadu: <strong>RM 45,106,380.00</strong></span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">There are total of <strong>187 </strong>company that have been participated in this tender. IPS rank is <strong>50/187.</strong></span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">From the bidding\nsubmission value, we have indicate and allocate any hidden cost such as SST,\nTraining, site preparation and etc.</span></p><p><br></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">30/8/2023 Update:</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Partner info - </span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">There are 20 company\nshortlisted in every zon. There are Sundata, Night Electronics, Iburuj. These 3\ncompany are among the company who has been shortlisted in many zones.</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">﻿﻿HP - the most\nshortlisted brand. Lenovo as well but not much.</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Cash in hand - must be 5m\nas backup if happen any delayed in implementation.</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Last audited report must\nbe 5m as well.</span></p>', NULL, NULL, NULL, 'Awarded to THETA TECHNOLOGIES SDN. BHD. @ 47,398,977.00', '2023-08-29 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
