n-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Menyediakan unit gantian sementara dalam tempoh 30 hari\nselepas surat pemakluman kepada syarikat </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Melaksanakan perkhidmatan penyelenggaraan pencegahan\n(Preventive Maintenance) secara berkala iaitu dua (2) kali setahun untuk tempoh\n60 bulan</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Mengadakan satu (1) Bengkel Penyelarasan Pengurusan\nProjek selama tiga (3) hari dua (2) malam bagi 40 orang sepanjang tempoh\nkontrak</span></p></li></ol><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><br></p>', '<p style=\" margin: 0cm 0cm 8pt; font-size: 11pt; line-height: 15.6933px; color: rgb(51, 51, 51); font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); font-family: Calibri, sans-serif;\"><span lang=\"MS\" style=\" font-family: Arial, sans-serif;\">Tempoh pelaksanaan:</span></p><p style=\" margin: 0cm 0cm 8pt; font-size: 11pt; line-height: 15.6933px; color: rgb(51, 51, 51); font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); font-family: Calibri, sans-serif;\"><span lang=\"MS\" style=\" font-family: Arial, sans-serif;\">Tempoh kontrak ini adalah untuk tiga 5 tahun tiga 5 bulan.</span></p><p style=\" margin: 0cm 0cm 8pt; font-size: 11pt; line-height: 15.6933px; color: rgb(51, 51, 51); font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); font-family: Calibri, sans-serif;\"><span lang=\"MS\" style=\" font-family: Arial, sans-serif;\">a) Pembekalan, pemasangan dan konfigurasi – Dalam masa lima (5) bulan dari tarikh mula kontrak.</span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Untuk tender ini, kami berkerjasama dengan <b>Lenovo</b> kerana\nkami telah berbincang bersama sebelum tender keluar. Kita juga akan menggunakan\nLenovo leasing facilities yang bernilai <b>3.12%</b> per tahunan dimana lebih\nmurah dari harga leasing pihak syarikat sewaan. Untuk servis juga, Lenovo akan\nmembekalkan staging, image, delivery dan maintenance. Lenovo yakin untuk\nmembekalkan product mereka <b>3-5 </b>weeks. Untuk Zon 1 ini, kami mencadangkan\n<b>AMD</b> bagi item Komputer Riba Biasa dan harga kami adalah dibawah julat <b>-10%.</b></span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Kami juga berkerjasama dengan <b>Etech Distribution Sdn\nBhd</b> bagi perkakasan yang lain seperti Pencetak Multifunction, Projektor,\ndan Charging Cart.</span></p><p><br></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Harga Isianpadu:</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Jumlah Keseluruhan: <b>RM 39,864,860.00</b></span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Kami telah mengambil kira dari setiap sudut kemungkinan\nadanya kos tersembunyi seperti SST, Certified Training, Bengkel 3 hari 2 malam,\nsite preparation dan etc.</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Sejumlah <b>179 </b>syarikat telah mengambil bahagian\ndalam tender ini. Harga Isianpadu adalah di tangga yang ke <b>22</b>. Perbezaan\nharga di antara syarikat yang lain adalah berdasarkan Analisa kami seperti\nberikut:</span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Sebanyak <b>4</b> pembida berkedudukan lebih rendah\ndiantara <b>RM39,782,811.00- RM 39,864,860.00 </b>dengan mengambil kira julat <b>-10%.</b></span></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span lang=\"MS\" style=\"font-family:&quot;Arial&quot;,sans-serif;\">Kami berharap, dengan hanya <b>4</b> pembida yang berada\ndalam julat <b>-10% </b>, peluang untuk IPS menang lebih mudah untuk\ndiusahakan.</span></p>', NULL, NULL, NULL, 'Submitted. Ranking 22/179\nTechnical and financial evaluation done.\nPending for board meeting\n\nLost to PRIVASIA SDN BHD -', '2023-09-15 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
