(631, 'UM.G/GD/PR/804/2023/24', 'PEROLEHAN NAIKTARAF INFRASTRUKTUR RANGKAIAN TANPA WAYAR (RTW) KOLEJ KEDIAMAN KELIMA DAN KOLEJ KEDIAMAN KEDUA BELAS UNIVERSITI MALAYA', 'PEROLEHAN NAIKTARAF INFRASTRUKTUR RANGKAIAN TANPA WAYAR (RTW) KOLEJ KEDIAMAN KELIMA DAN KOLEJ KEDIAMAN KEDUA BELAS UNIVERSITI MALAYA', 0, 0, 176, 0, 0, 0, 6, NULL, 10, '2023-10-11', NULL, 2717717.00, 2100398.00, NULL, NULL, NULL, 6, 36, 2717717, '2023-10-11', '<p>H3c AP and Cabling Works (UTP &amp; Fiber).</p><p>Racks.</p><p><br></p>', '<p>6 months.</p><p>Evaluation technical had done.</p><p>No new feed back untill now.</p>', '<p>Submitted ranked at 2nd. cheapest.</p>', NULL, NULL, NULL, 'Submitted ranked at 2nd. cheapest.\nRuckus partner won the tender.\nThey had cut the quantity lower than us for a better pricing and margin.', '2023-10-10 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
(632, 'BIL.15/2023', 'PEROLEHAN INFRASTRUKTUR DAN PERKHIDMATAN BAGI PROJEK PEMBANGUNAN SISTEM MYINVOIS DI LEMBAGA HASIL DALAM NEGERI MALAYSIA', 'PEROLEHAN INFRASTRUKTUR DAN PERKHIDMATAN BAGI PROJEK PEMBANGUNAN SISTEM MYINVOIS DI LEMBAGA HASIL DALAM NEGERI MALAYSIA', 0, 0, 43, 0, 0, 0, 5, NULL, 6, '2023-10-11', NULL, 47000000.00, 39112982.00, NULL, NULL, NULL, 6, 36, 47000000, '2023-12-01', '<p>Server, Storage, Network, Software, Latihan, Services - 3 Years.&nbsp; On Demand (3 Yr Future Upgrade)&nbsp;</p><p>Perolehan Permulaan - </p><p>Perkakasan 16,072,021.00 (HP)</p><p>Perisian 5,543,108.00 (Microsoft)&amp;(Comvault)</p><p>Latihan 2,025, 620.00 (Local &amp; Overseas)</p><p>Perkhidmatan 2,366,792.00 (Support)</p><p><br></p><p>On Demand</p><p>Perkakasan - 12,582,397.00</p><p>Perisian - 7,833,558.00</p><p>Perkhidmatan 576,504.00</p>', '<p>6 Months implement all servers and network.</p>', '<p>Ranked 3/21 from list of submission price. Price is 47,000,000.00. From HP we are the second cheapest. cheapest is iBuruj. Customer currently using HP. We provide some added value on chat bot WhatsApp and additional number of pax for training.&nbsp;</p><p>6/11/23 - Been informed technical evaluation had been done. Still no status as checked at Financial Level, no names yet at their end. Project should award by end of this year. Lead time for the hardware to reach KL should take 6 months max. Does not depend to tender - MyInvois apps development work as that shall resides on the cloud.</p><p>15/11/23 - We had passed the technical and financial evaluation. We are competing with Dell hardware.&nbsp;</p><p>Our competitor that is using DELL proposal for submission : FGV, Zen Comp, Heitech, Teknokrat Niaga, CET Dev, Strategic Alliance, Weststar, Strateq.</p><p>Justification to maintain HP - Easy process to do migration. Implementation period can be in shorter period of time. User already familiar with HP brand. HP still ranked top 3 brand in Gartner.&nbsp;</p><p>HP is giving us fully support for this deal.</p><p>We believe that we have a good merit in terms of technical and financial to implement this project to LHDN successfully. We would like to seek top level from the management in assisting to win this deal.</p><p><br></p><p><br></p><p>Why we choose HP for this tender ? - For En ISA.</p><ol><li>HPE solution for hybrid cloud management platform (Morpheus) is recognized as a Leader in Gartner\'s Magic Quadrant for Cloud Management&nbsp;Platforms&nbsp;(CMP).</li><li>HPE has implemented Morpheus CMP to manage hybrid cloud for Malaysia’s&nbsp;largest&nbsp;bank.</li><li>Morpheus is a 100% agnostic cloud management platform (CMP) designed from the ground up to unify management of multi-cloud, can support all cloud providers (AWS, Google, Google, Oracle,&nbsp;IBM&nbsp;and&nbsp;etc.)</li></ol>', NULL, NULL, '2023-12-15', 'Submitted. Ranked at no. 3/22. We passed technical and financial evaluation. Our paper been brought to the board meeting soon. We are proposing HP and competing with Dell paper.', '2023-10-10 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
(633, 'QT230000000009875', 'PEROLEHAN DAN PENYELENGGARAAN LESEN PERISIAN SERTA PERKHIDMATAN PEMULIHAN BENCANA SISTEM PERAKAUNAN AKRUAN KERAJAAN NEGERI (iSPEKS) DI 11 KERAJAAN NEGERI', 'PEROLEHAN DAN PENYELENGGARAAN LESEN PERISIAN SERTA PERKHIDMATAN PEMULIHAN BENCANA SISTEM PERAKAUNAN AKRUAN KERAJAAN NEGERI (ISPEKS) DI 11 KERAJAAN NEGERI', 0, 0, 177, 0, 0, 0, 6, NULL, 7, '2023-10-11', NULL, 29470000.00, 24509499.00, NULL, NULL, NULL, 6, 36, 29470000, '2023-10-11', '<p>Oracle software new - 7,536,597.82 Oracle existing software - 16,064,568.18. 3rd Party software - 452,618.00. Total submission 29,470,000.00</p><p><br></p>', '<p>2 years 6 Months.</p>', '<p>EP price ranked at no. 2/16. Our partner is protecting us for the Oracle Pricing. We are using one of our partners (Professional Services) to communicate with Azhar from JANM. Technical evaluation seems ok and currently under financial evaluation. Since JANM resides under MOF, Financial Tender Board committee sits under MOF. We did not have any contact at MOF Working Level and Top Management Level.</p>', NULL, NULL, NULL, 'Ranked 2/16. Submitted. Already done technical evaluation. Been informed that we passed the technical evaluation. 11.10.23 currently under financial evaluation.', '2023-10-10 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
