(638, 'PTPTN/ 2023/T11', 'TENDER PEROLEHAN PEMBAHARUAN PENYELENGGARAAN PANGKALAN DATA INFORMIX UNTUK PERBADANAN TABUNG PENDIDIKAN TINGGI NASIONAL BAGI TEMPOH 5 TAHUN', 'TENDER PEROLEHAN PEMBAHARUAN PENYELENGGARAAN PANGKALAN DATA INFORMIX UNTUK PERBADANAN TABUNG PENDIDIKAN TINGGI NASIONAL (PTPTN) BAGI TEMPOH LIMA (5) TAHUN', 0, 0, 53, 0, 0, 0, 6, NULL, 9, '2023-10-23', NULL, 7800000.00, 6859735.00, NULL, NULL, NULL, 12, 60, 7800000, '2023-10-23', '<p>Renewal of Licenses for IBM Informix Ent Edition - VPC for 12 units. 5 Years Validity.</p><p>Renewal of Licenses for IBM Informix Advance Ent. 4 units. 4 Years Validity.&nbsp;</p><p>Renewal of Red Hat Ent Linux Server Primium. 10 Units. 5 Years.&nbsp;</p><p><br></p><p>- Informix Database Migration and upgrade for all the PTPTN\'s Informix Data Servers.</p><p>- Redhat Enterprise Linux Server Premium Installation, Setup and Implementation.</p><p>- IBM Informix Advanced Enterprise Edition Installation, Setup and Implementation.</p><p>- Upgrade &amp; Implementation of IBM <span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">InformixHQ<span>&nbsp;</span></span> for all the PTPTN\'s Informix Data Server.</p><p>- Setup &amp; configure of <span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">IBM <span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">InformixHQ<span>&nbsp;</span></span></span> 24/7 Support &amp; Event Management for all PTPTN\'s Informix Data Servers.</p>', '<p>year 2 - year 5.&nbsp;</p><p>&nbsp;- Proactive Maintenance Support Services and IBM InformixHQ Performance Monitoring for all the PTPTN\'s Informix Server</p><p>&nbsp;- Preventive Maintenance 2x per year.</p><p>&nbsp;</p>', '<p>Replacing DB Sonar with IBM <span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">InformixHQ</span>&nbsp;DB monitoring tools. This can <strong>save PTPTN cost</strong> from DB SONAR up to RM800,000 per year.&nbsp;</p><p>Allocate 5 pax for overseas conference.</p><p>Allocate 2 pax engineer on - site for support.&nbsp;</p><p>Technical evaluation PASSED.</p><p>Been informed tender status shall be announced by Dec 2023.</p><p><br>Request top management to cover on the high level.</p><p><br><br><br></p>', NULL, NULL, NULL, 'Submitted. From the technical we are at no. 6. Top 5 all is DELL solution. Proposal had pass to MOF for financial Evaluation. Isianpadu passed commercial evaluation.\nLost to Milipol Technologies (M) Sdn Bhd. - RM7,646,835.90', '2023-10-22 16:00:00', 0, 0, '0000-00-00 00:00:00', 0),
