(648, 'QT230000000023297', 'PERKHIDMATAN MENGKAJI, MEREKA BENTUK, MEMBANGUN, MEMBEKAL, MENGHANTAR, MEMASANG, MENGKONFIGURASI, MENGUJI DAN MENTAULIAH GUNA SERTA PELUASAN PROJEK PELAKSANAAN ELECTRONIC MEDICAL RECORD (EMR) UNTUK KL', 'PERKHIDMATAN MENGKAJI, MEREKA BENTUK, MEMBANGUN,\nMEMBEKAL, MENGHANTAR, MEMASANG, MENGKONFIGURASI, MENGUJI DAN\nMENTAULIAH GUNA SERTA PELUASAN PROJEK PELAKSANAAN ELECTRONIC\nMEDICAL RECORD (EMR) UNTUK KLINIK KESIHATAN DAN KLINIK PERGIGIAN\nKEMENTERIAN KESIHATAN MALAYSIA (KKM) DI NEGERI SEMBILAN BAGI\nPENINGKATAN DAN PELUASAN TPC-OHCIS BAGI TEMPOH KONTRAK 36 BULAN\n', 0, 0, 37, 0, 0, 0, 1, NULL, 7, '2023-11-11', NULL, 36800000.00, 33925532.00, NULL, NULL, NULL, 24, 36, 36800000, '2024-01-01', '<p>a)&nbsp; Peningkatan fungsi Sistem TPC-OHCIS Versi 1.1 kepada Sistem TPC-OHCIS Versi 1.2 bagi mematuhi ketersediaan capaian perkongsian maklumat kesihatan secara bersepadu</p><p>b)&nbsp;Membekal, Menghantar, Memasang, Mengkonfigurasi, Menguji Dan Mentauliah Guna Perkakasan ICT,Perisian, Peralatan Rangkaian, Penyediaan Local Area Network (LAN) dan Perkhidmatan kerja-kerja kejuruteraan elektrik Di Klinik Kesihatan (KK) Dan Klinik Pergigian (KP) Bagi Peluasan TPC-OHCIS</p><p>c)&nbsp;Merangka, merancang dan melaksanakan aktiviti Data Migration di Pusat Data dengan minimal Downtime bagi memastikan versi sedia ada berfungsi dengan lancar sepanjang tempoh kontrak.</p><p>d)&nbsp;Mencadangkan Dan Menyediakan Pelan Backup Dan Recovery, Business Continuity Plan (BCP) dengan khidmat nasihat daripada pihak Kementerian.</p><p>e)&nbsp;Merancang dan Melaksanakan Perkhidmatan Change Management (CM) di klinik kesihatan dan klinik pergigian dengan khidmat nasihat daripada pihak Kementerian.</p><p>f)&nbsp;Melaksanakan Perkhidmatan Latihan Pengguna / Train The Trainers (TTT) dan Transfer of Technology (ToT) kepada pihak kementerian.</p><p>g)&nbsp;</p>', '<p>24 months implemenatation and roll out with additional 12 months maintenance</p>', '<p>Price ranking at 8/16</p><p>Cheapest at 33.5M</p>', NULL, NULL, NULL, 'Price ranking at 8/16\nCheapest at 33.5M\nTechnical evaluation done and shorrlisted\nTechnical shortlisted', '2023-11-10 16:00:00', 65653, 0, '0000-00-00 00:00:00', 0),
