(755, 'KP/10/9/33/2 K1', 'KPDRM Network, Server and Security Infrastructure', 'PEMBAHARUAN PERKHIDMATAN PENYELENGGARAAN, LESEN TAHUNAN, JAMINAN PERKAKASAN DAN PERISIAN BAGI INFRASTRUKTUR DAN RANGKAIAN(NETWORK, SERVER & KESELAMATAN INFRASTRUKTUR) DI BANGUNAN\nKOPERASI POLIS DIRAJA MALAYSIA BERHAD', 0, 0, 205, 0, 0, 0, 2, NULL, 7, '2024-05-28', NULL, 3564000.00, 2834000.00, NULL, NULL, NULL, 12, 36, 3564000, '2024-07-01', '<p><strong>Renewal maintenance services</strong> -&nbsp;&nbsp;<span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">H3C Core Switches, H3C Access Switch, H3C Access Point. DELL UPS, Makelsan UPS, Sophos Firewall, Fortigate Firewall, DELL Switches</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: Roboto, &quot;Segoe UI&quot;, GeezaPro, &quot;DejaVu Serif&quot;, &quot;sans-serif&quot;, -apple-system, BlinkMacSystemFont; font-size: 14px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\"></span><strong style=\"font-size: 0.875rem; background-color: unset; text-align: inherit;\">Licenses renewal </strong>- Tipping Point, SOLIDServer, VMWare, Piolink, Veeam Backup, Sophos Firewall, Fortigate Firewall<span style=\"font-size: 0.875rem; background-color: unset; text-align: inherit;\">﻿﻿</span></p><p><strong>Hardware and software warranty</strong> - H3C Core Switches, Access Switch, Access Point, Lenovo Backup Server and Storage Backup, DELL Switches</p><p><strong>Supply new hardware and software </strong>- H3C Managed Switch, Veeam Backup and Replication, Rack 42U, VM Backup and Restore, Domain Cert SSL and SPA</p>', '<p>Project Timeline</p><ul><li>Contract Period : <strong>36 months (3yrs)</strong></li><li>Hardware and Delivery Setup : <strong>12 months&nbsp;</strong></li><li>Support Services : ﻿﻿<strong>36 months (3yrs)</strong><br></li></ul>', '<p>IPS will work closely with partners i.e. Fortesys, VSTECS, and others.</p><p>We have an engagement with former incumbent - ex Heitech Padu, to better understand client expectation / EU expectation.</p>', NULL, NULL, NULL, 'Tender submitted on 7 June 2024.\n\nAs at 26 June 2024, KPDRM undergoing Technical Evaluation. Most pricing is out of range. Closest bidder to indicative budget is RM1.7mil and RM1.3mil.\n\nNo update / decision yet.', '2024-05-27 16:00:00', 1, 0, '0000-00-00 00:00:00', 0),
