d and according to their\nbudget.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\ncolor:#333333;background:white;\">We believe our competitors go with lower price.\nSome known competitors in IAB are Ofisgate and Poketdata.</span></p></li></ol><p>Status:</p><ul><li>Evaluation both technical and financial done. We scored 6/10 for technical &amp; 7/10 for financial. This is due to few technical cert (CCIE and OSCP) that our partner couldn\'t provide (5/10/2022)</li><li>IPS shortlisted along with another 5 company. Meeting committee will be held on 12th October. (7/10/2022)</li></ul>', NULL, NULL, NULL, 'Lost to Rifhan Technology.', '2022-09-30', 'dacf50dc-cd49-4d6e-8e36-81bc1d34c71f', NULL, '36:48.8', NULL),
