(455, 'QT220000000038704', 'MOE NETWORK IPGK', 'PERKHIDMATAN NAIK TARAF SISTEM RANGKAIAN KAMPUS INSTITUT PENDIDIKAN GURU KAMPUS (IPGK) ZON KHAS, KPM (ZON KHAS: IPGK S', NULL, NULL, 22, NULL, NULL, NULL, 6, NULL, 10, '2023-01-06', NULL, 4282282.00, 3900272.00, NULL, NULL, NULL, '8', '36', '4282282', '2023-05-31', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Objektif:</span></p><ol level=\"1\" style=\"list-style-type: lower-alpha;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;\nfont-family:&quot;Segoe UI&quot;,sans-serif;\">Melaksanakan perkhidmatan menaik taraf\ninfrastruktur kabel rangkaian kampus (Cable Network).</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;\nfont-family:&quot;Segoe UI&quot;,sans-serif;\">Melaksanakan perkhidmatan menaik taraf\ninfrastruktur rangkaian tanpa wayar kampus (Wifi Network).</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;\nfont-family:&quot;Segoe UI&quot;,sans-serif;\">Membekal, memasang, mengkonfigurasi,\nmengujilari, mentauliah, menyenggara (dalam tempoh jaminan) perkakasan\nperalatan rangkaian kampus dan pengurusan polisi rangkaian berkaitan\nberdasarkan keperluan senarai peralatan dan lokasi di IPGK terbabit. </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Melaksanakan\nperkhidmatan Meja Bantuan (Helpdesk) dan Call Center/Support.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Melaksanakan\nperkhidmatan penyelenggaraan (membaik pulih serta pembetulan kerosakan –\nRemedial Maintenance (RM) / Corrective Maintenance (CM)) bagi peralatan dalam\ntempoh 3 tahun jaminan (Warranty).</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;\nfont-family:&quot;Segoe UI&quot;,sans-serif;\">Membekalkan</span> Certified Training dan\nPemindahan Teknologi (Transfer of Technology – ToT)</p></li></ol><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:10.5pt;line-height:107%;font-family:\n&quot;Segoe UI&quot;,sans-serif;color:#333333;background:white;\">Skop Tender:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:10.5pt;line-height:107%;font-family:&quot;Segoe UI&quot;,sans-serif;\">Membekal,\nmemasang, mengkonfigurasi, mengujilari, mentauliah, menyenggara (dalam tempoh\njaminan) perkakasan peralatan rangkaian kampus dan pengurusan polisi rangkaian\nberkaitan berdasarkan keper