(500, 'QT230000000020712', 'Hospital Ampang HIS Technology Refresh', 'TENDER PERKHIDMATAN MENGKAJI, MEREKA\nBENTUK, MENGANALISA, MEMBANGUN, MEMBEKAL, MENGHANTAR, MEMASANG,\nMENGKONFIGURASI, ', NULL, NULL, 37, NULL, NULL, NULL, 1, NULL, 1, '2023-10-09', NULL, 25301305.00, 9999999.99, NULL, NULL, NULL, '24', '36', '2530130', '2024-01-01', '<p>Technlogy refresh of current HIS application and infra that has been in usage for more than 17 years. The scope of refresh covers</p><p>a) HIS application refresh from 5.x to 12.x. Woriking with Dedalus</p><p>b) core switch refresh. Using CISCO solution</p><p>c) Others hardware which include Dell Servers, Dell PC, Dell notebook, Dell SAN, A10 load balancer, HP and Zebra printers, BARCO monitors, Neuripower UPS, Ergotron COW</p><p>d) Oracle software via ASFU Dedalus</p><p><br><br><br><br><br></p>', '<p>24 months implementation and 12 year maintenance. Total 36 months</p>', '<p>IPS being the current HIS maintenance provider, the current status of the evaluation as follows:</p><p>a) 4 company pass the technical evaluation from 13 vendors. IPS is in the list with Iburuj (25M), CET (cheaper price at 22M)&nbsp; and unknown vendor at 21.9M&nbsp;</p><p>b) Finaniclal evalution done and we pass&nbsp;</p><p>c) Technical commitee propose IPS for the bid</p><p>d) Expected tender board to decide in Nov meeting</p><p><br></p><p>Being an incumbent for current HIS Maintenance in Ampang, the propose 2 years implementation for HIS tech refresh will be easily manage, deliver and transition if the incumbent is being awarded.&nbsp; Currently, Hospital Serdang is engaging the same vendor for maintenance and tech refresh.</p><p>Our submisison is based on Hospital Ampang requirements, exactly one-to-one; CISCO switches and Veritas Backup Alliance in which was not spelt out in the tender documents.</p><p>Engagement of friendly party at tender board/DG/KSU level.&nbsp;</p><p>Have also inform friendly party that direct competitor is proposing a processor technology back in 2019 as oppose to tender specs which required current 2023 processors.</p><p>Arrangement has been made for higher level lobbying at MOH</p><p>Tender board in Dec</p>', NULL, NULL, NULL, '13 bidders\nIPS price ranked 9/13\nonly 4 bidders technically shortlisted and IPS is one of them\nPrice range from 21M to 32M\nIPS pass the technical and financial evaluation and being proposed\ntender board expected in', '2023-10-31', '65653a32-dd4b-4208-96b0-0e74f9b67703', NULL, '09:42.3', NULL),
