(641, '1', 'Modernization For Lembaga Tabung Haji', 'LTH Modernization', NULL, NULL, 44, NULL, NULL, NULL, 1, NULL, 5, '2024-01-31', NULL, 10000000.00, 8000000.00, NULL, NULL, NULL, '1', '1', '1', '2023-11-07', '<p>Conversion from CA 2E to Java.</p><p>Tools is - Fresche / Base100.<br></p><p>Akard solution.<br></p><p><br><br></p>', '<p>3 years or more.</p><p>6 months warranty.</p>', '<p>Winning on the small project. Estimated at 6,000,000.00&nbsp;</p><p>Full scale project at 40 or 60,000,000.00&nbsp;</p><p>Doing tech update session with IBM Akard - Tech Update.</p><p>Consulting with Haji Zakaria, Haji Asraf, Haji Shahidan and Haji Hanizam Haniff.<br><br><br></p><p><br></p>', NULL, NULL, NULL, 'Still working on finding the best solution. Working with Ikon Perkasa, Team Akad Solution, FST and IBM.\n\n', '2023-11-07', '0c6e5acf-35fc-4a0c-83a1-5e0de34956e5', NULL, '13:43.9', NULL),
(642, 'None', 'Migration Financial Management Systems / FMS Oracle Cloud', 'Mingration FMS Oracle Cloud to On - Premis', NULL, NULL, 44, NULL, NULL, NULL, 1, NULL, 7, '2024-01-31', NULL, 2000000.00, 2000000.00, NULL, NULL, NULL, '6', '36', '2500000', '2024-02-07', '<p>Migrating all data from Oracle Cloud to on Premis.</p>', '<p>CGSO ask LTH to migrate on prem for the project to happen. Because all data is confidential. They were asked to move to on prem implementation.</p>', '<p>Waiting for Oracle to Confirm.</p><p>Consulting Haji Sirajuddin and Haji Ashraf.</p>', NULL, NULL, NULL, 'Waiting for Oracle', '2023-11-07', '0c6e5acf-35fc-4a0c-83a1-5e0de34956e5', NULL, '44:49.5', NULL),
(643, '44958', 'LTAT Contribution Management System (LCMS)', 'CONTRIBUTION MANAGEMENT SYSTEMS - LTAT', NULL, NULL, 73, NULL, NULL, NULL, 5, NULL, 5, '2023-11-07', NULL, 15754552.00, 9999999.99, NULL, NULL, NULL, '12', '24', '8357079', '2023-11-07', '<p>Project Management of LCMS.</p><p>Purchasing the OCR document scanner.</p><p>Digital Signature.</p><p>Development of LCMS systems.</p>', '<p>Partner with Aerosense&nbsp;</p><p>Develop using open-source platform.</p><p>Migration from the old sow to a new paperless system implementation.</p><p>Integration with other external party systems.<br>Cover new integration with Mindef for future systems development.<br></p><p><br></p><p><br></p>', '<p>Currently runs on POC - 8/11/2023. Total 10 companies been called.&nbsp;</p><p>We are number 6 to be presented (Bidder 1)</p><p>We had done the POC.&nbsp;</p><p>We had been called for price nego.</p><p>We amended based to the discussion, to add on / change to all free licenses especially on the DB to Ent DB. Red Hat Ent OS etc for 8 yrs.</p><p>Pricing for maintenance and support 8yr had been separated for the total cost.&nbsp;</p><p>Pricing Change Mangement supposed not to be included.</p><p>Man-days rate shall not be calculated in the project cost.</p><p>New Costing - 8,357,079.22 with SST / 7,884,037.00 WO SST</p><p>Maintenance and support 8 years - 6,978, 745</p><p>Total - 14,862,785.00 WO SST</p><p>Prev Costing - 11,700,000 WO SST.</p>', NULL, NULL, '2023-12-19', 'Submitted. POC on Wednesday 8 Nov. Shortlisted to top 2. Company 1 is Apex. We had to change pricing due to change of software to enterprise version renewal up to 8 years.\nPrice is updated 2/12/23', '2023-11-07', '0c6e5acf-35fc-4a0c-83a1-5e0de34956e5', NULL, '29:43.1', NULL),
(644, 'KWAP/01/123/23/12', 'RFP Accounting Systems', 'PROPOSAL FOR THE REPLACEMENT OF THE ACCOUNTING SYSTEM FOR KWAP', NULL, NULL, 40, NULL, NULL, NULL, 6, NULL, 5, '2023-07-26', NULL, 4644000.00, 4102664.00, NULL, NULL, NULL, '6', '36', '4565875', '2024-01-15', '<p>Project Management.</p><p>Project Implementation.</p>', '<p>Partnering with Starvision.</p>', '<p>We need to re strategized on the maintenance costing. Customer doesn\'t agree with our costing for yearly maintenance.</p><ol><li>We had been called for the POC, we are no 2/5 companies from the list. ﻿﻿</li><li>Done for 3 days POC. Seems the feedback is good in terms of technical. Our POC had been given a good responds from the users. Our company profile is good. Kwap said by Dec all POC should be done for all 5 companies.</li><li>Currently our company is under financial and track record evaluation process.</li><li>Just to inform that our website should have some information regarding our proposal for this tender. As they will visit the website as part of the company evaluation process.</li><li>Need our top management to help get the info regarding our company evaluation process to push to be top 2.</li><li>Our partners mentioned that SAP also bid for this tender.</li><li>The current systems is using Censoft software.</li><li>DB is using DB2.</li><li>KWAP is currently pending the finalizing of the excesize, we shall be able to update by the 2nd Quarter of 2024.</li><p style=\"margin:0cm;font-size:12.0pt;font-family:&quot;Aptos&quot;,sans-serif;\"><br></p></ol>', NULL, NULL, NULL, 'Submitted. POC is on 17/11/2023 - 22/11/2023. POC done, for final day we invited En Wan Faizal for the project management support in the presentation. Been informed month Disember shall start the commercial evaluat', '2023-11-07', '0c6e5acf-35fc-4a0c-83a1-5e0de34956e5', NULL, '45:08.0', NULL),
