(267, 'RFX 4000042582', 'TNB Storage', 'SUPPLY, INSTALLATION, TESTING, COMMISIONING, AND SUPPORT OF EXPANSION OF COMMVAULT INFRA WITH DEDICATED HYBRID STORAGE', NULL, NULL, 21, NULL, NULL, NULL, 6, NULL, 7, '2022-09-09', NULL, 5490000.00, 5284428.00, NULL, NULL, NULL, '6', '36', '5490000', '2023-01-02', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\" class=\"pasteContent_RTE\"><span style=\"font-size:12.0pt;line-height:107%;\">OBJECTIVE:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\" class=\"pasteContent_RTE\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">To provide backup storage\ninfrastructure, media agent servers, and implementation services to the\nexisting Commvault backup </span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Dedicated Hybrid storage with\nautomated tiering is proposed for BCRM and Non-BCRM environments to replace both\nshort-term and long-term backup storage to ensure no storage problems on the\nCommvault backup solution</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Dedicated Commvault Media Agent servers\nas Media Agent (Commvault) are proposed for BCRM and Non-BCRM environments to\nreplace the old servers in the TNB data centre. The scope of projects will\ncover for the production (Bangi) site and non-production (Bangsar) site.</span></p></li></ol><p><br class=\"pasteContent_RTE\"></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\" class=\"pasteContent_RTE\"><span style=\"font-size:12.0pt;line-height:107%;\">SCOPE OF\nTENDER:</span></p><ol level=\"1\" style=\"list-style-type: lower-roman;margin-bottom:0cm;\" class=\"pasteContent_RTE\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Site\nPreps. Involve power cable with commando installation, OM3 Fibre Aqua Blue, UTP\nCable, labelling and tagging follow standard TNB’s practices.</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Installation,\nintegration with DCIM TNB of APC Rack and configuration (1 in DC Bangi &amp; 1\nin DC Bangsar)</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Installation\nand configuration of 4 units storage (2 units DC Bangi &amp; 2 units DC\nBangsar). Dedicated for BCRM and Non-BCRM</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Installation\nand configuration of 6 units server (4 units DC Bangi &amp; 2 units DC Bangsar)</span></p></li><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Installation\nand configuration of 6 units Media Agent (3 BCRM &amp; 3 Non-BCRM)</span></p></li></ol><p><br class=\"pasteContent_RTE\"></p><p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\" class=\"pasteContent_RTE\"><span style=\"font-size:12.0pt;line-height:107%;\">Isianpadu Submission\nPrice:</span></p><ol level=\"1\" style=\"list-style-type: decimal;margin-bottom:0cm;\" class=\"pasteContent_RTE\"><li style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:36.0pt;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><p><span style=\"font-size:12.0pt;line-height:107%;\">Submission: RM 5,490,000.00</span></p></li></ol>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">For this\ntender, we are working closely with Hitachi as they are one of the preferred brand\nfor Hybrid Storage (other brand is IBM). Hitachi has done engagement from upper\nto lower for this tender. </span></p>', '<p style=\"margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:11.0pt;font-family:&quot;Calibri&quot;,sans-serif;\"><span style=\"font-size:12.0pt;line-height:107%;\">We are ready\nto negotiate price with TNB if called for it. Beside that, we will also provide\nadded value if based from our experience and expertise from similar projects.</span></p><p><span style=\"color: rgb(51, 51, 51); font-family: Calibri, sans-serif; font-size: 16px; font-style: normal; font-weight: 400; text-align: left; text-indent: 0px; white-space: normal; background-color: rgb(255, 255, 255); display: inline !important; float: none;\">1) We have pass the technical evaluation. Commercial evaluation is still on going (25/10/2022).</span><br></p><p><br></p>', NULL, NULL, NULL, '1) We have pass the technical evaluation. Commercial evaluation is still on going (25/10/2022)\n2) Commercial evaluation is done pending status whether shortlisted or not (23/11/2022)\n3) Awarded to Micro Technology.', '2022-09-12', 'dacf50dc-cd49-4d6e-8e36-81bc1d34c71f', NULL, '48:35.6', NULL),
